(10,	74,	1,	'Přestože hodnotím celkově projekt jako velmi dobrý, tak nepovažuji osobní ohodnocení 80 Kč až 87 Kč na hodinu jako opodstatněné a adekvátní. Jedná se o čistě dobrovolnou činnost a já se domnívám, že v takovém případě by se její organizátoři měli spokojit s maximálně symbolickým platem. Pokud však organizátoři pod nálepku \"osobního ohodnocení\" skrývají některé náklady, tak by měli ve své žádosti upřímně říci, kam peníze půjdou.\r\n\r\nV tuto chvíli tedy musím být proti podpoření projektu. Pokud mi však bude výše odměn dobře odůvodněna na setkání SK s akademickou obcí, tak jsem samozřejme ochoten projektu svou podporu dát. ',	'firstRating'),
(5,	74,	0,	'',	'firstRating'),
