(7,	74,	0,	'',	'firstRating'),
(9,	74,	0,	'',	'firstRating'),
(14,	74,	1,	'Přestože je projekt velmi dobře zpracovaný a domnívám se, že má také velmi dobrý odborný přínos a sloužil by k dobré propagaci FSS, tak je dle mého názoru vyčíslení pokrytí odpracovaných hodin (200 Kč za hodinu) neadekvátní. Pokud bude tato částka dobře obhájena při případném rozhovoru na setkání stipendijní komise s akademickou obcí, jsem ochoten tento projekt podpořit. ',	'firstRating'),
