(11,	73,	0,	'',	'firstRating'),
(14,	73,	1,	'Ne příliš přesvědčivě doložené osobní ohodnocení ex post s nejasným vztahem k propagaci FSS/studentských aktivit FSS (podle materiálů případná podpora vyznívá jako podpora pouze ze strany IIPS). Bylo by lépe o takovéto granty žádat dopředu s jasnějším rozpisem buď obsahu práce a/nebo zapojením propagace podpory SK AS/FSS (jelikož je žádána částka ze stipendijního fondu).',	'firstRating'),
(13,	73,	1,	'Bohužel projektu chybí garant. Rovněž by bylo dobré racionalizovat ekonomickou rozvahu nad schůzkou - není lepší nakoupit potraviny/občerstvení a sejít se v jiném než kavárenském prostředí, uvařit si sami apod.? A potom příp. i ušetřit? Jinak ovšem podobný druh podpory mi není cizí, rozhodně bych doporučil, nebýt formálního pochybení.',	'firstRating'),
(9,	73,	0,	'',	'firstRating'),
(12,	73,	1,	'Bohužel, analogicky k druhé z žádostí, nevyhovuje formálním požadavkům.',	'firstRating'),
(7,	73,	0,	'',	'firstRating'),
(8,	73,	1,	'Vzhledem k tomu, že není jasné propojení s výukou/zda se bude promítat v rámci školní výuky, ve škole, není vůbec zahrnuto vyřešení autorských práv. Promítání filmů mimo výuku je bez vyřešení autorských práv (a tedy jejich zahrnutí do žádaného stipendia) dle současné legislativy ilegální, i když si budou film pouštět studenti. Je bohužel potřeba dořešit tento detail.',	'firstRating'),
(6,	73,	0,	'',	'firstRating'),
(5,	73,	0,	'',	'firstRating'),
(10,	73,	1,	'Stejný projekt podán dvakrát. Podpořeno podání s materiálovými náklady. Příště by bylo vhodné projekty sloučit.',	'firstRating'),
(11,	72,	1,	'Nepodložené náklady (416,666¯/os/noc) - částka vypadá spíše jako nepřesný odhad, než výsledek práce na projektu.\r\nV takto jednostranně zaměřeném projektu bych očekával specifikaci vašeho výběru konkrétního ubytovacího zařízení (případně srovnání, dokazující vaši snahu o co nejefektivnější alokaci zdrojů) a přesný výpočet ceny.',	'firstRating'),
