(12,	74,	1,	'Chybí garant. ',	'secondRating'),
(13,	74,	1,	'Chybí garant.',	'secondRating'),
(8,	74,	1,	'Bohužel nebylo dostatečně vysvětleno, proč se projekt nijak nevypořádává s problematikou autorských práv na promítané filmy. Domnívám se, že argumentace vedená přes to, že projekt je součástí výuky, je nedostatečná. Především ve chvíli, když by se promítání pořádalo mimo budovu FSS. ',	'secondRating'),
(7,	74,	0,	'',	'secondRating'),
(11,	74,	1,	'Nedoporučuji k podpoře. Zástupkyně žadatele nám na setkání komise s akademickou obcí oznámila, že náklady na ubytování neodpovídaly v realitě tomu, co je napsáno v projektu. Doporučuji proto žádost přepsat podle reálných čísel a podat znovu. Zároveň doporučuji, aby se žadatel řídil radami, které jsme na setkání uvedli. Jistě by bylo dobré, aby nám v žádosti svůj projekt představil detailněji. Zároveň bych byl rád za širší představení celého rozpočtu. Jakým podílem se na něm bude případně podílet stipendijní komise. A jaké další subjekty se na financování podílely. ',	'secondRating'),
(5,	74,	0,	'',	'secondRating'),
(10,	74,	0,	'',	'secondRating'),
(9,	74,	0,	'',	'secondRating'),
(6,	74,	0,	'',	'secondRating'),
(14,	74,	1,	'Domnívám se, že ohodnocení osobních aktivit v takovéto výši by mělo patřit do jiné stipendijní výzvy. ',	'secondRating'),
(5,	73,	0,	'',	'secondRating'),
(10,	73,	1,	'Duplicitní, podpořen projekt s materiálovými náklady.',	'secondRating'),
(8,	73,	1,	'I přes písemné vysvětlení žadatelů nedoporučuji k podpoře z důvodů nevyřešené otázky autorských práv. Zdůvodnění: a) FSS má tradičně přísnou licenční politiku a její případné porušení na základě příspěvku ze stipendií by mohlo být vážným problémem (jakkoliv autor tohoto hodnocení není zastáncem tohoto rigidního právního výkladu), b) na základě konzultace autorskoprávní problematiky s právníky na rektorátě před delší dobou i na základě vlastní zkušenosti z filmové branže je podané vysvětlení sice logické, ale neodpovídá současnému právnímu milieu: jde o to, kdo má k danému obsahu přístup. Vzhledem k tomu, že se promítá mimo regulérní výuku mimo školu, mohou se účastnit i nestudenti, tím pádem jde o veřejné promítání dle zákona (a je tedy potřeba ošetřit autorskoprávní ochranu). Pokud by např. měli přístup na základě ISIC pouze studenti, myslím, že by to mohlo stačit - vždy by ale bylo dobré podobný projekt nejprve konzultovat s univerzitními právníky. \r\nc) Souhlasím s nárokem studentů a studentek a podporuji \"open access\" projekty a myslím si, že pro vzdělávací a neziskové účely by otázka autorských práv měla být zákonodárcem vedena jinak, nicméně tak jako tak jde o otázku změny zákonů, která zatím neproběhla. Je tedy potřeba současnou právní úpravu respektovat a respektovat i současný stav přísného postupu autorskoprávních institucí. \r\n\r\nDOPORUČUJI: podat projekt znovu, tentokrát ale vyřešit otázku AP - buď prokázat dobrozdání od univerzitních právníků, nebo zahrnout do žádaného stipendia částku na AP nebo prokázat, že majitelé AP částku prominuli (což lze předpokládat - stačí zvednout telefon a zavolat produkci, např. Hypermarket film apod. jistě placení AP pro tyto účely prominou a ještě se s nimi lze domluvit na osobní účasti tvůrců).',	'secondRating'),
(6,	73,	0,	'',	'secondRating'),
(13,	73,	1,	'Nesplněné formální požadavky (garant). Jinak velmi prospěšný projekt, doporučuji podat znovu (bez nákladů na chlebíčky, stačí prokázat hodinovou dotaci na porady a zažádat podporu na osobní hodnocení autorů projektu).',	'secondRating'),
(12,	73,	1,	'Nesplněné formální požadavky (garant).',	'secondRating'),
(7,	73,	0,	'',	'secondRating'),
(14,	73,	1,	'Nevhodné pro tento stipendijní program, doporučuji zvolit jiný.',	'secondRating'),
(9,	73,	0,	'',	'secondRating'),
(11,	73,	0,	'',	'secondRating'),
(7,	72,	0,	'Váš projekt mě velice zaujal, myslím, že bude pro zúčastněné přínosem.\r\nMoje jediná připomínka směřuje k propagaci, respektive metodě výběru účastníků - domnívám se, že při takto malém počtu míst je třeba buď nějakým způsobem (užším zaměřením) snížit počet zájemců či si vymyslet kritéria, jak zájemce filtrovat...',	'secondRating'),
(14,	72,	0,	'Váš projekt mě velice zaujal. Jako spornou vidím jen spojitost programu s fakultou, respektive její propagaci.',	'secondRating'),
(11,	72,	1,	'Nepodloženost rozpočtových výdajů a jejich zřejmá (obhajujícím potvrzená) nepravdivost mě bohužel nutí označit Váš projekt za nevhodný k podpoře.\r\nDo budoucna bych doporučil tuto část projektu nepodceňovat a uvádět zásadně pravdivé údaje spolu se systematikou jejich výpočtu.',	'secondRating'),
(9,	72,	1,	'Projekt nedoporučuji v podpoře z důvodu nejasnosti metodiky výpočtu nákladů v rozpočtu a obecně akce, na kterou mají být některé z nákladů použity.',	'secondRating'),
(10,	72,	0,	'Je škoda, že jste ve svém projektu nezmínili například svou tradici s pořádáním podobných akcí a reporty z nich, neboť právě takovéto informace by pro vás mohly být při hodnocení velkým plusem.\r\n\r\nPřekvapilo mě také, že někteří vaši (naši) kolegové vyčkávají ohledně účasti na takovéto akci na existenci či neexistenci výplaty. (toto berte jako poznámku na okraj, s hodnocením projektu to nesouvisí)',	'secondRating'),
(5,	72,	0,	'Je škoda, že jste ve svém projektu nezmínili například svou tradici s pořádáním podobných akcí a reporty z nich, neboť právě takovéto informace by pro vás mohly být při hodnocení velkým plusem.\r\n\r\nPřekvapilo mě také, že někteří vaši (naši) kolegové vyčkávají ohledně účasti na takovéto akci na existenci či neexistenci výplaty. (toto berte jako poznámku na okraj, s hodnocením projektu to nesouvisí)',	'secondRating'),
(8,	72,	1,	'Projekt nedoporučuji k podpoře ze dvou důvodů:\r\n\r\n1) Odměny pro organizátory mi příjdou nepřiměřené, neboť promítání filmů nevyžaduje zdaleka takovou přípravu.\r\n2) U vašeho projektu vidím důvodné podezření pro porušování autorského zákona. Kdybyste za takovouto činnost ještě ke všemu dostávali peníze, mohli byste se dostat do konfliktu nejen s fakultou, která má velice přísnou politiku v tomto směru, ale i se státními orgány. \r\n\r\nPro případné další žádosti doporučuji si autorské zákony pečlivě nastudovat a ve své žádosti pečlivě vysvětlit, proč je s nimi Váš projekt v souladu.',	'secondRating'),
(13,	72,	1,	'!garant, po získání garance doporučuji opětovnou žádost.',	'secondRating'),
(12,	72,	1,	'!garant, po získání garance doporučuji opětovnou žádost.',	'secondRating'),
(6,	72,	1,	'Z rozpočtu není čitelná systematika jeho vzniku, což vzhledem k závaznosti rozpočtu pro realizaci akce vidím jako zásadní nedostatek (zvlášť když projekt už běží a vy byste tedy měli mít velice přesnou představu o jeho nákladech).\r\n\r\nDoporučil bych vám také popřemýšlet o zakoupení vlastní domény, CZ doména v současnosti stojí méně než 300Kč a vzhledem k nemalým ambicím vašeho projektu by mi to přišlo rozhodně důstojnější, než vynakládat 2500Kč na web, který ještě ke všemu ani není na adresované doméně, ale na google sites.',	'secondRating'),
(11,	75,	0,	'',	'secondRating'),
(14,	75,	1,	'Komise bohužel zatím nemůže snižovat či jinak upravovat požadovanou částku, proto říkám ne - odměna je podle mého názoru nepřiměřená a o stipendium by si Tomáš Vlček měl zažádat v jiném programu (pro talentované studenty).',	'secondRating'),
(13,	75,	1,	'Těším se, až si Honza Martinek zažádá podruhé s formálně vyhovující žádostí.',	'secondRating'),
(9,	75,	0,	'',	'secondRating'),
(12,	75,	1,	'Těším se na druhé setkání s tímto projektem, tentokráte s formálně vyhovující žádostí.',	'secondRating'),
(7,	75,	0,	'',	'secondRating'),
(8,	75,	1,	'Jak bylo správně upozorněno, žadatel to nemá obstojně vyřešené s otázkou autorských práv. Nedoporučuji proto projekt podpořit v jeho současném stavu.',	'secondRating'),
(6,	75,	0,	'',	'secondRating'),
(5,	75,	0,	'',	'secondRating'),
(10,	75,	0,	'',	'secondRating'),
(17,	74,	0,	'',	'firstRating'),
(21,	71,	0,	'',	'firstRating'),
(20,	71,	1,	'projekt nesplňuje formální požadavky - není zde garance',	'firstRating'),
(23,	71,	1,	'- garance se neshoduje s žádostí u dvou žadatelů\r\n- žádost by byla vhodnější pro stip.program 2A',	'firstRating'),
(17,	71,	0,	'- nedořešenost kontinuity projektu (bude spravován na soukromých stránkách)\r\n- nevyřešena otázka propagace stránek\r\n- problém reprezentativnosti dokumentů\r\n- znamená projekt doopravdy zjednodušení nebo doublování již zveřejněné agendy?\r\n- bude existovat forum pro zpětnou vazbu a případnou změnu, jak autor píše?\r\n- kdo se zapojí? - reprezentativnost oborů, spolků\r\n- proč se akce koná v restauračním zařízení a ne ve více \"pracovním prostředí\"?',	'firstRating'),
(18,	71,	0,	'- nejasný rozpočet (jak k jednotlivým položkám žadatelka došla?)\r\n- žadatelka se nevyjadřuje ke způsobu propagace\r\n- vysoká částka pro osobní ohodnocení\r\n- chybí podrobnější plán realizace',	'firstRating'),
(22,	71,	0,	'- nejasné položky rozpočtu, pro diskuzi by byla vhodná specifikace (resp. jak žadatelky k částkám došly)',	'firstRating'),
(26,	71,	0,	'- není konkrétní plán realizace\r\n- zapojí se úplně všechny spolky MU (jaké konkrétně)\r\n- jak je koordinace a spolupráce zajišťována?\r\n- jaký je plán propagace\r\n- systém financování z lístků není jasný (40-70 kč jde spolku a dalších 40-70 kč \"spolčení\" MU? a dalších XY organizátorům Majálesu?)\r\n- jak došli žadatelé k částkám v předkládaném rozpočtu?\r\n- co konkrétně jednotlivé položky rozpočtu znamenají?',	'firstRating'),
(29,	71,	0,	'- náklady na večeři jsou nepřiměřené (cca 500kč/os.)\r\n- v rámci debaty by bylo potřebné upřesnit náklady na propagaci\r\n- jaká bude propagace FSS?\r\n- jaké je zapojení studentů FSS?',	'firstRating'),
(19,	71,	0,	'- nutné specifikovat požadovaný rozpočet\r\n- jaké je zapojení studentů a případně akademických pracovníků FSS\r\n- jak bude FSS propagována\r\n- program? kolik lidí participuje?\r\n- jaké jsou zkušenosti pořadatelů?',	'firstRating'),
(16,	71,	0,	'- ve veřejné diskuzi je třeba specifikovat položky rozpočtu\r\n- jak bude propagována FSS?\r\n',	'firstRating'),
(24,	71,	0,	'- pro kolik studentů je akce určena?\r\n- pro koho je akce určena?\r\n- jak probíhá spolupráce s fakultou?\r\n- jaká bude propagace FSS?',	'firstRating'),
(25,	71,	0,	'',	'firstRating'),
(15,	71,	0,	'- bližší specifikace navrhovaného rozpočtu\r\n- bylo zažádáno i o stipendium na jiných fakultách MU?\r\n- jedná se pouze o studenty FSS nebo i jiných fakult?\r\n- kolik členů orchestr má',	'firstRating'),
(27,	71,	0,	'',	'firstRating'),
(28,	71,	0,	'- jak žadatel dospěl k uvedené částce?\r\n- jaká bude propagace FSS?\r\n- garance se neshoduje s žádostí',	'firstRating'),
(21,	75,	1,	'Projekt dle mého není vhodný podpořit - propagace a lektorné, na které žádá Tomáš Protivínský stipendium, jsou již v příloze započítány do rozpočtu jako vyřešené. Nechápu tedy, jak je to doopravdy, požaduji objasnění, na co tedy stipendium chtějí a prozatím navrhuji nepodpořit tento projekt.',	'firstRating'),
(20,	75,	0,	'Projekt se mi líbí, ale text v dokumentu odborné garance s ním vůbec nekoresponduje - co tedy Hloušek garantuje? \r\nA znovu se tu objevuje problém s osobním ohodnocením - jaká částka/hod už je moc?',	'firstRating'),
