(22,	73,	0,	'Doporučuji na veřejné setkání připravit strukturu financování tisku (tj. efektivitu nákladů). Z textu není zřejmá.',	'firstRating'),
(26,	73,	0,	'Doporučuji na veřejné setkání připravit rozvahu nákladů na \"program\" - není zcela jasné, jak budou prostředky vynaloženy. Jinak velmi potřebný projekt.',	'firstRating'),
(20,	73,	1,	'Doporučuji jiný stipendijní program, nejde o spolkovou či kulturní činnost, mělo by se rovněž lépe hradit ze stipendijních prostředků příslušné katedry.',	'firstRating'),
(21,	73,	0,	'',	'firstRating'),
(23,	73,	0,	'',	'firstRating'),
(28,	73,	0,	'',	'firstRating'),
(18,	73,	0,	'Doporučuji diskutovat pronájem místností. Vzhledem k zaměření  charakteru aktivity by měl být dle mého názoru prominut. Není zřejmá spolupráce s nějakou katedrou - zde by se hodilo spoluorganizování s případnou logistickou/finanční pomocí.',	'firstRating'),
(29,	73,	0,	'',	'firstRating'),
(19,	73,	0,	'Není jasné, jak projekt bude podporovat fakulta. Myslím, že není správné spoléhat v tomto případě a v akci tohoto formátu pouze na stipendijní fond. Podobný projekt by měl být zaštíten fakultou a ta by měla poskytnout prostředky k jeho podpoře nad rámec běžných mechanismů.',	'firstRating'),
(16,	73,	0,	'',	'firstRating'),
(24,	73,	0,	'',	'firstRating'),
(30,	73,	0,	'Nájmy místnosti by zvláště ke spojitosti akce s IIPS měla saturovat fakulta. Pokud jsou nájmy za použití místností v akademickém prostředí (i mezinárodně) naprostým zjevením, v tomto smyslu jsou nemorální a posilují systém, jak získat peníze do rozpočtu FSS z jinak nedostupného stipendijního fondu. IIPS je legitimní součást FSS a FSS by neměla žádat nájmy po studentech - zvláště v tomto případě. Projekt bych nedoporučil proto k podpoře, ale ze solidarity se studenty a studentkami tak činím. Situaci s nájmy je však potřeba okamžitě řešit.',	'firstRating'),
(25,	73,	1,	'Předkladatelé by měli zdůvodnit položku \"doména\". Za takovou částku se dá koupit jedna lotyšská doména (LT), ale českých (CZ) hned deset!! I TLD .com a .tv, velmi žádaná doména z dražších, jsou levnější. Pochybuji, že chtějí autoři expandovat např. na lotyšský internet. Jinak dobrý projekt - z tohoto důvodu však není možné v této formě doporučit k podpoře.',	'firstRating'),
