(20,	74,	0,	'Velmi dobrý projekt. Přesto bych rád navrhl snížit požadovanou částku. Myslím si, že požadovaná odměna pro realizátory (90Kč/hodina) by mohla být snížena například na 70 Kč/hodina. ',	'firstRating'),
(28,	74,	0,	'Tohoto projektu se sice přímo neúčastním, ale jsem mu velmi blízko. Z tohoto důvodu se zdržuji hlasování. ',	'firstRating'),
