(18,	72,	1,	'Prosím o upřesnění metody výpočtu rozpočtu',	'firstRating'),
(25,	72,	1,	'Vzhledem k velkým nejasnostem v rozpočtových záležitostech nevidím řešením v pouhém snížení částky, ale doporučuji podat novou žádost, která se bude opírat o reálné výpočty ze smysluplných podkladů.',	'secondRating'),
(15,	72,	0,	'Výborný nápad, nákup bicí soupravy podporuji. \r\nBudete-li mít připravený další projekt za účelem financování propagace, neváhejte se zúčastnit některého z dalších kol.',	'secondRating'),
(23,	72,	1,	'Z důvodu kolize s účelem stipendijního programu 6A doporučuji požadovat proplacení uvedených nákladů z programu 2A či mimořádných stipendií fakulty. \r\nNezavrhuji podporu rozvoje Vašeho spolku z titulu 6A, doporučuji se tedy v případné další žádosti orientovat spíše na rozvoj samotné organizace a pořádání akcí (AMČR v debatování).',	'secondRating'),
(29,	74,	0,	'Podílím se na organizaci tohoto projektu a nebudu tedy hodnotit ani v druhém kole.',	'secondRating'),
(28,	74,	0,	'Mám k tomuto projektu osobně velmi blízko a zdržuji se hlasování.',	'secondRating'),
(23,	74,	0,	'Samotné debatování považuji za velmi přínosnou činnost, především pro debatující studenty. K debatování soutěže patří a je tedy dobré studenty v této činnosti podporovat. Jelikož ovšem skutečně nemá tento projekt širší záběr, nezapojuje další studenty a podobně, domnívám se, že by mohl být k jeho financování využit nejlépe jiný stipendijní program. Je to ovšem spíše doporučení do budoucna. V tuto chvíli projekt podporuji. ',	'secondRating'),
(24,	74,	0,	'Velmi se mi líbíla prezentace projektu na diskuzi s komisí. Žadatelé mají vše velmi dobře připravené a je evidentní, že vědí, co chtějí. Také samotná žádost je zpracována solidně. Obvzláště kvizuji detailní zpracování rozpočtu. ',	'secondRating'),
(25,	74,	0,	'Myšlenka projektu se mi samozřejmě velmi líbí. Také pozitivně hodnotím, že žadatelky byly ochotné snížit požadovanou částku. Pokud by se žedatelkám i přesto nepodařilo dosáhnout na podporu, tak bych doporučil v případném dalším podání podrobněji připravit celý rozpočet, který by jasně ukazoval všechny částky a především jejich návaznost na realizaci projektu.',	'secondRating'),
(26,	74,	0,	'Projekt prezentace MU na Majálesu mě skutečně zaujal. Především zapojením univerzitních spolků. Tento projekt by měl vyústit v trvalejší spolupráci spolků a to je skvělé. Přeji v tomto organizátorům hodně štěstí, protože to nebudou mít vůbec lehké. \r\nJako pozitivní chápu to, že projekt nechce čerpat peníze jen ze stipendijního fondu, ale že má dobře propracovaný fundraising, který se zasloužil o zisk financí z různých zdrojů. Na prezentaci projektu před komisí organizátoři prokázali, že akci mají velice dobře rozmyšlenou, vědí, co chtějí a jsou organizačně schopni akci uskutečnit. ',	'secondRating'),
(22,	74,	1,	'Projekt Halasu jako takový samozřejmě podporuji. Bohužel ovšem nemohu souhlasit s požadovanou výší financí, které jsou ze stipendijního fondu vyžadovány. Osobně se domnívám, že na financování by se měla podílet samotná fakulta. To však není problém žadatelů. Co však žadatelé jsou schopni ovlivnit je výše nákladů na tisk. Halas by měl nejdříve prokázat aktivní snahu o snížení těchto nákladů (levnější papír, mix levného a drahého, atd.). Poté by jistě nebyl problém, aby stipendijní fond na částečné pokrytí nákladů přispěl.  ',	'secondRating'),
(30,	74,	0,	'Velmi potřebný projekt pro fakultu i studenty. Žádost je kvalitně zpracována. Především si cením toho, že žadatelé byli schopni si dojednat odpuštění pronájmů místností. Prokázali tak aktivní snahu o snížení rozpočtu, což hodnotím velmi pozitivně. Budu velmi rád, když jim tato snaha přispěje k zisku stipendia. \r\n',	'secondRating'),
(20,	74,	0,	'Osobně považuji tento projekt za skvělý. Problémy s rozpočtem se z mého pohledu vyřešily snížením požadované částky, které bylo domluveno na setkání s komisí. Zároveň původní nesrovnalost s garancí byla přesvědčivě vyvrácena. Věřím, že realizace projektu by byla velmi prospěšným krokem. ',	'secondRating'),
(18,	74,	0,	'Především pozitivně hodnotím ochotu žadatelky snížit požadovanou částku. Tím se projekt dostal do mnohem realističtějších finančních požadavků vůči komisi. Přesto je škoda, že žadatelka nevypracovala podrobněji celý rozpočet již v žádosti, ale podrobnosti předložila teprve na setkání s komisí. Tím se jí přirozeně snižují body za první hodnocení. ',	'secondRating'),
(17,	74,	0,	'Projekt je jistě dobrý. Přesto pochybuji, že dává natolik vysokou přidanou hodnotu oproti současným informačním zdrojům fakulty a univerzity, že by se vyplatila vložená investice (myslím investice především časová, ne finanční). Jinak ale musím většinu náležitostí projektu hodnotit pozitivně. ',	'secondRating'),
(16,	74,	0,	'Tomuto projektu velmi fandím. Domnívám se, že jeho realizace je velmi prospěšná především pro obory politických věd. Jde o nevšední konferenci, která rozvíjí nejen znalosti účastníků, ale také sounáležitost komunity. Zároveň dochází k inspirativním přednáškám, které mnohdy vedou k vzniku nových a prospěšných projektů - například ve sféře občanské společnosti. \r\n\r\nŽádost jako taková je kvalitně zpracována. Přestože byly konkrétní položky v rozpočtu pozměněny (akce již proběhla a žadatel výdaje doložil účtenkami na setkání s komisí), byly provedené změny velmi korektně obhájeny. ',	'secondRating'),
(27,	74,	0,	'Projekt nedoporučuji k podpoře. Žadatelé se nedostavili na setkání s komisí a nebyli tak schopni vysvětlit nesrovnalosti v rozpočtu, které jsem měl. \r\nŽadatelé uvádějí nerealistické ceny za tisk. Stačí se kouknout na webové stránky tiskáren, abych poznal, že uvedené ceny jsou přehnané. Skutečné ceny za kus by byly (cca):\r\n      A3: 15 Kč/kus (ne 50 Kč)\r\n      A4: 8 Kč/kus (ne 30 Kč)\r\n      A6: 5 Kč/kus (tady se shodneme v ceně za kus, ale nevím, jak jste     \r\n              znásobením 50ti kusů s 5 Kč/kus přišli na částku 500 Kč)\r\n\r\nŽadatelé nakonec poslali mail s vysvětlením, oznámili skutečné částky a snížili rozpočet. Původně jsem projekt pro výše uvedené nesrovnalosti nechtěl vůbec podpořit. Po vysvětlení je to již v pořádku. Přesto dávám nižší hodnocení za rozpočet. Nedomnívám se, že je na podobné akce nutné tisknout na 150g křídový papír. Žadatelé by se měli na podobných částkách snažit ušetřit. A na nástěnce je velmi málo poznat rozdíl mezi 150g křídou a 100g hlazeným papírem. \r\n',	'secondRating'),
(19,	74,	0,	'',	'secondRating'),
(21,	74,	0,	'',	'secondRating'),
(21,	71,	1,	'- nemá příliš spojitost s FSS\r\n- těžko říci, jak žadatel k částkám, o něž žádá došel (nemohlo být vyjasněno na veřej.zasedání, neboť se žadatel nedostavil)',	'secondRating'),
(20,	71,	0,	'- během veřejné diskuze předložena zaměněná garance\r\n- snížený rozpočet vytvořen poněkud účelově\r\n- žadatelé požadují částku 10 tisíc Kč: 1100 Kč na materiály, 800 Kč na občerstvení, 9100 Kč jako odměnu pro realizátory projektu\r\n- potřebný projekt, pokud nebude podpořen, nelze ho financovat z prostředků katedry či jiného stip.programu?\r\n- dobrá prezentace na veřejném zasedání, která předčila písemné zpracování',	'secondRating'),
(23,	71,	1,	'- přestože projekt je bezesporu dobrý, bylo by vhodnější ho podpořit z jiného stipendijního programu (2A) či vzhledem k provázanosti s činností katedry politologie z jejích prostředků\r\n',	'secondRating'),
(17,	71,	0,	'- dobrá prezentace na veřejném zasedání, vč. vysvětlení problematických bodů\r\n- projekt není příliš důvěryhodný \r\n- kontroverzní výběr zapojených osob \r\n',	'secondRating'),
(18,	71,	0,	'- pěkný projekt\r\n- mezioborovost a propagace FSS\r\n- propojuje teoretické znalosti s praxí\r\n- doporučuji zažádat o další fin.prostředky i z jiných zdrojů\r\n- žadatelka snížila rozpočet na 9500Kč: 4000 Kč na propagaci, 1000Kč na občerstvení, 2000Kč na cestovné, 2500 Kč na odměny pro realizátory',	'secondRating'),
(27,	71,	0,	'- pěkný projekt\r\n- precizní zpracování\r\n- rozpočet dovysvětlen\r\n- rozpočet snížen v položce \"tisk propagačních materiálů\" na 941Kč - celkově nově žádáno o 5991 Kč\r\n- propojení teoretických dovedností s praktickými znalostmi zúčastněných osob',	'secondRating'),
(15,	71,	0,	'- dobrý projekt, který je záhodno dlouhodobě podporovat\r\n- žadatel snížil rozpočet na 6000 Kč, které požaduje na zakoupení bicí soupravy\r\n- žadatel obhájil částku, kterou požaduje \r\n- bylo by vhodné žádat i na dalších fakultách o podporu\r\n- doporučuji zvýšit informovanost o tělese (např. univerzitní noviny a časopisy, zlepšit webovou stránku)',	'secondRating'),
(25,	71,	1,	'- projekt je dobrý, co se týče propagace FSS a spojitosti s její vzdělávací činností\r\n- zároveň propojuje praktické a teoretické oblasti\r\n- projekt bohužel zatím není příliš důvěryhodný\r\n- žadatelky nemají jasnou představu o nákladech\r\n- rozpočet snížen na částku 8950 Kč: 1100 Kč na vytvoření domény, 3750 Kč na vytvoření webu, 2100 Kč na vytvoření obsahu webu, 2000 Kč na získávání kontaktů \r\n- je potřeba více promyslet jednotlivé fáze projektu a jeho realizaci\r\n- doporučuji přepracovat a zažádat znovu',	'secondRating'),
(15,	74,	0,	'K žádosti nemám žádné negativní připomínky. Přestože nevidím příliš velký potenciál pro konkrétní propagaci FSS, naprosto tento fakt vyvažuje přínos pro celou univerzitu. Projektu si velmi vážím. Zároveň pozitivně hodnotím realistické finanční požadavky a celkové zpracování žádosti.',	'secondRating'),
(30,	71,	0,	'- SS IIPS patří k tradičním tělesům FSS, které by měly být podpořeny\r\n- poté, co byl upraven rozpočet, je projekt vhodný k podpoře\r\n- SS IIPS nově žádá o 7000Kč: 5000Kč na náklady pro hosty, 400Kč na trailer a 1600 Kč na odměnu pro pořádající členy (celkem 12 studentů) \r\n- propojuje teoretické a praktické dovednosti\r\n- umožňuje studentům realizovat vlastní nápady\r\n- splňuje kritérium víceoborovosti, přestože je primárně určen pouze několika oborům\r\n- bylo by vhodné hledat fin. prostředky i z jiných zdrojů',	'secondRating'),
(29,	71,	0,	'- důvěryhodný projekt\r\n- malá spojitost s FSS, nicméně projekt realizují její studenti\r\n- propojení teoretických a praktických dovedností\r\n- rozpočet obhájen\r\n- projekt pomáhá ke zlepšení dobrého jména MU, má ambice rozšířit se do ostatních měst a dosáhnout přenosu v TV\r\n- význam projektu dokládá i financování z jiných zdrojů mimo MU\r\n- projekt by jednoznačně měl být podpořen',	'secondRating'),
(19,	71,	1,	'- projekt působí nedůvěryhodně\r\n- většina záložek na webových stránkách nefunguje\r\n- chybí informace o projektu\r\n- jak probíhá propagace?\r\n- stále nespuštěna registrace, přestože projekt se má uskutečnit za dva měsíce\r\n- jaké je zapojení domácích studentů a jak se o možnosti zapojení mohou dozvědět?\r\n- je nejasné, jak žadatelé k předloženým částkám došli\r\n- projekt by bylo záhodno podpořit, neboť bude reprezentovat FSS i celou MU\r\n- bohužel se však žadatelé na veřejné zasedání nedostavili, aby vysvětlili sporné body\r\n- projekt z těchto důvodů působí nedořešeným a nepřipraveným dojmem, v této podobě není vhodný k podpoře\r\n',	'secondRating'),
(24,	71,	0,	'- projekt je rozhodně vhodné podpořit\r\n- propojuje teoretické a praktické znalosti studentů\r\n- je úzce napojen na vzdělávací činnost FSS\r\n- napomáhá k prohlubování vazeb mezi studenty daného oboru\r\n- žadatelé obhájili rozpočet\r\n- je nutné dořešit propagaci projektu a jeho kontinuitu\r\n- celkově se jedná o potřebný projekt, jehož obdoba by ideálně měla fungovat pro každý obor FSS',	'secondRating'),
(16,	71,	0,	'- rozhodně dobrý projekt, který je třeba podpořit\r\n- představuje neformální setkání politologů, přičemž lze zde nalézt zajímavá přednášená témata\r\n- není pouze seriózní konferencí, ale aplikuje tradiční koncepty na odlehčená témata\r\n- ideálně tak propojuje teoretické znalosti s praktickými dovednostmi\r\n- obdobná setkání by měla fungovat i pro jiné obory FSS\r\n- žadatel vysvětlil rozpočet - za ušetřené peníze z nájmu navýšil částku na nákup knih (byly cenou v soutěži)\r\n- důvěryhodnost zvyšuje již opakované konání akce\r\n- přínosem je, že prezentace a zvukový záznam má být přístupný na internetu',	'secondRating'),
(26,	71,	0,	'- projekt je podporován rektorátem MU (finančně nákupem stanů a propagačními předměty)\r\n- projekt je schopen vystačit z vlastních zdrojů (prodej vstupenek a vzájemná výpomoc zapojených spolků)\r\n- není vyřešena kontinuita projektu\r\n- žadatelé se  na veřejném zasedání dobře vypořádali s otázkami, které Komise předložila během prvního kola',	'secondRating'),
(22,	71,	1,	'- Halas je přínosným projektem pro FSS\r\n- na jeho spolufinancování by se měla podílet fakulta (mimo rámec stip.fondu 6A)\r\n- je nutné hledat finanční prostředky i z jiných zdrojů\r\n- některé náklady, jak vyplynulo z diskuze, lze snížit\r\n- projekt, který by bylo vhodné dlouhodoběji podpořit, v současné podobě však nikoliv',	'secondRating'),
(28,	71,	0,	'- projekt napomáhá k dobrému jménu FSS\r\n- propojuje praktické a teoretické znalosti studentů\r\n- je realizován studenty FSS\r\n- je nutné hledat fin.prostředky i z jiných zdrojů\r\n- tato aktivita by rozhodně měla být podpořena',	'secondRating'),
