(21,	75,	0,	'Moc se mi nelíbil přístup žadatelů \"Co tam máme teda napsat, abyste nám to uznali?\", ale projekt se mi zdá samozřejmě přínosný a určitě je vhodné ho podpořit.',	'secondRating'),
(20,	75,	0,	'Námět projektu se mi moc líbí. Stále jsem ale nepochopila, jak je to s tou garancí - přiložen je úplně jiný dokument.',	'secondRating'),
(23,	75,	0,	'Jsem pro podporu navrhovaného.',	'secondRating'),
(28,	75,	0,	'Jsem zcela pro podporu tohoto projektu. Je to skvělý projekt, který mají na starosti studenti různých oborů FSS a tento projekt má velkou budoucnost.',	'secondRating'),
(17,	75,	0,	'Skvělý nápad, který zaslouží podpořit.',	'secondRating'),
(18,	75,	0,	'Netradiční nápad, líbí se mi.',	'secondRating'),
(22,	75,	0,	'Časopis Halas má jistě svoje místo na fakultě, přesto bych ale dala přednost jiným projektům při podpoře ze stipendijního fondu.',	'secondRating'),
(26,	75,	0,	'Projekt není špatným nápadem - nevím ale, zda se propagace spolků a fakulty na festivalu Majáles nemíjí účinkem.',	'secondRating'),
(29,	75,	0,	'Skvělý projekt, doporučuji k podpoře.',	'secondRating'),
(19,	75,	0,	'Dobrý nápad, na zpracování by to ovšem chtělo ještě zapracovat.',	'secondRating'),
(16,	75,	0,	'Výborný a úspěšný projekt, který si zaslouží podporu.',	'secondRating'),
(24,	75,	0,	'Originálním způsobem řešený projekt pro navazování kontaktů (nejenom) pomocí jakéhosi teambuildingu. Snad se záměř zadaří dle představ.',	'secondRating'),
(30,	75,	0,	'Činnost studentstké sekce IIPS si rozhodně zaslouží pozornost a podporu. ',	'secondRating'),
(25,	75,	0,	'Na tento projekt jsem zvědavá, není mi moc jasné, o co přesně studenti usilují. Těším se na výsledek.',	'secondRating'),
(15,	75,	0,	'Jsem pro podporu tohoto projektu - je potřeba si vážit i takovýchto studentských aktivit. Jsou neméně důležité než ostatní. ',	'secondRating'),
(27,	75,	0,	'Jsem pro podporu tohoto projektu kvůli zajímavému tématu a skvělému zpracování.',	'secondRating'),
(24,	72,	0,	'Domnívám se, že tento projekt bude přínosem pro navázání meziročníkových kontaktů mezi studenty BSS a je tedy vhodné ho realizovat.',	'secondRating'),
(22,	72,	0,	'Halas by nutně potřeboval schopný management, který dostane jeho finanční záležitosti do přijatelnějších čísel, být s každým číslem do takovéto míry ve ztrátě je dlouhodobě nepřijatelné.',	'secondRating'),
(30,	72,	0,	'Gratuluji Vám k dosažení dohody o prominutí nájmů, s upravenými náklady doporučuji projekt k podpoření.',	'secondRating'),
(20,	72,	0,	'',	'secondRating'),
(18,	72,	1,	'Pokrácení rozpočtu pro mě v tuto chvíli bohužel není dostatečným argumentem pro podpoření projektu, jehož rozpočet je vypočítán nejasným způsobem. Doporučuji podání nové žádosti spolu s podklady, ze kterých bylo vycházeno.',	'secondRating'),
(16,	72,	0,	'Gratuluji k úspěchu akce. ',	'secondRating'),
(17,	72,	0,	'Projekt Fakultní wiki je dobrým nápadem, který bude jistě ku pomoci nejen studentům prvního ročníku. Doporučuji ještě zvážit, zda by web neměl existovat přímo na doméně muni.cz, respektive některé z jejích subdomén (4.-5. řádu).',	'secondRating'),
(28,	72,	0,	'Projekt je výrazným přispěním ke snahám o kontrolu chování politiků, držím vám palce!',	'secondRating'),
(29,	72,	0,	'Váš projekt výborně reprezentuje celou MU, přeji hodně úspěchů do budoucna.',	'secondRating'),
(27,	72,	0,	'',	'secondRating'),
(21,	72,	0,	'V této podobě schvaluji. K případným příštím žádostem vždy přikládejte co možná nejvíce informací.',	'secondRating'),
(26,	72,	1,	'Projekt po úvaze nedoporučuji k podpoře, neboť v tuto chvíli jsou dost nejasné vaše programové záměry, stejně jako celkové zisky z prodeje lístků.\r\nTento můj krok nemá být blokováním vaší akce ze strany komise, jako spíše snaha o zefektivnění podpory projektu; doporučuji vám (v případě, že v tomto kole váš projekt nebude podpořen) žádat v dalším kole již s reálnými informacemi a čísly rozpočtu, tj. nemít odhad nákladů (který může, vzhledem k nejasným příjmům z lístků, vykazoval velkou odchylku), ale již kompletní přehled všech příjmů a výdajů, na základě kterého budete žádat o ztrátovou část vašeho rozpočtu v zájmu jeho anulace.',	'secondRating'),
(19,	72,	1,	'Z projektu mi není jasná metodika výpočtu nákladů. Mrzí mě, že jste nemohli dorazit na obhajobu a rozpočet nám objasnit.',	'secondRating'),
(38,	74,	0,	'Projekt Tanečního orchestru MU jako takový považuji za velmi dobrý a přínosný jak pro studenty účastnící se projektu, tak pro celou univerzitu. Orchestr již prokázal, že je schopen uspořádat koncerty a navázaná spolupráce s MU ukazuje, že projekt má do budoucna velké vyhlídky. \r\n\r\nMěl bych pouze dvě připomínky: \r\nZ žádosti není jasné, zda je stipendium jediným vaším finančním zdrojem. Získává orchestr finance také například od MU, nebo jiných jednotlivých fakult?  \r\n\r\nBohužel musím dát nižší hodnocení v kolonce \"Propagace FSS\", protože se projekt netýká přímo FSS, ale spíše celé MU. U takového projektu je možnost propagace FSS hůře představitelná a žadatel se této otázce v žádosti nevěnuje. Byl bych tedy rád, když by mohl na setkání s komisí podrobněji rozvést také tento aspekt projektu.  ',	'firstRating'),
(36,	74,	0,	'Domnívám se, že projekt samostatných webových stránek byl pro Radio R velmi potřebný a je dobře, že stránky vznikly. Radio R funguje už velmi dlouho a jeho důvěryhodnost tak je nenapadnutelná. \r\n\r\nMám jednu jedinou poznámku, která se týká rozpočtu. V žádosti se píše, že je pro grafika a programátora žádána minimální odměna, jelikož již samotná práce pro ně byla přínosem (získali tak praxi). Nemyslím si, že odměna 137,50 Kč/hodina pro programátora je tak minimální. Uvědomuji si, že se ani nepřibližuje platu, který je v tomto oboru běžný. Ale pokud šlo o studenta rozšiřujícího si svou praxi, myslím si, že by se částka mohla snížit na úroveň 70 Kč/hodina. Zároveň nevím, jak bylo dosaženo částky pro grafika, protože u částky není uvedena hodinová zátěž. Bylo by vhodné tuto částku blíže vysvětlit. ',	'firstRating'),
(39,	74,	0,	'V současné podobě nemám proti žádosti Halasu větších připomínek. Velmi pozitivně hodnotím, že byly zapracovány téměř všechny připomínky, které ze strany Komise padly na předchozím stipendijním kole. Halas snížil požadovanou částku, Dokázal snížit cenu za jedno vydání a ještě výrazněji za celý semestr. Dále se podařilo získat sponzora v podobě tiskárny a inzerenty, kteří pokryjí částečně tisk časopisu.\r\n\r\nSnad jen jedna poznámka: Přestože si uvědomuji, že není již velký rozdíl mezi tiskem cca 500 kusů a 1000 kusů, tak v žádosti není obhájeno, proč se tiskne náklad 1000 kusů, když reálná prodejnost je někde pod pětisty kusy. V situaci, kdy se snaží časopis ušetřit se domnívám, že i onen minimální rozdíl v ceně stojí za zvážení. ',	'firstRating'),
(33,	74,	0,	'K projektu mám následující připomínku: \r\n\r\nRozpočet není dostatečně obhájen. Žádost se nevěnuje tomu, proč jsou žádány finance zrovna na položky, které jsou v rozpočtu uvedeny. Podílejí se účastníci turnaje finančně na nákladech? Například položka jídlo je největší částkou celého rozpočtu - proč je nutné proplácet stravu v takové výši? Jedná se v součtu o velkou sumu. Pro jednotlivé účastníky však již nejde o takovou úlevu. Je tato položka nezbytná? ',	'firstRating'),
(31,	74,	0,	'Z žádosti jsem plně nepochopil, proč žádáte jen část nákladů a ne celý objem potřebných financí. Také není vysvětleno, proč žádáte zrovna 7000 Kč. Jak jste k této částce dospěli? A jsou ty peníze určeny na přímé zaplacení hmotných nákladů, nebo má jít o odměny pro organizátory, případně účastníky výjezdů atd.? ',	'firstRating'),
(32,	74,	0,	'',	'firstRating'),
(35,	76,	0,	'Vzhledem k tomu, že jsem jeden z organizátorů projektu, nebudu tento projekt hodnotit',	'firstRating'),
(40,	76,	0,	'Vzhledem k tomu, že jsem členem redakce Global Politics, nebudu tento projekt hodnotit',	'firstRating'),
(34,	76,	0,	'Zajímavý projekt, který se doufám bude v budoucnu i nadále rozvíjet. Oceňuji zejména podrobnou žádost (včetně přílohy o odbornosti organizátorů) s podrobným rozpočtem. ',	'firstRating'),
(32,	76,	0,	'BeInternational je na FSS ojedinělým projektem s několikaletou tradicí a jasnými výsledky své práce, proto si projekt jistě zaslouží podporu.\r\nProsil bych nicméně o vysvětlení, jak žadatelé dospěli k nezvykle vysoké částce za korespondenci. Rovněž doporučuji si pro příště dávat pozor na správně uvedená data v žádosti.',	'firstRating'),
(31,	76,	0,	'Debatní klub je na FSS stabilní platforma, kterou je určitě vhodné podpořit. Výhradu mám nicméně ke zpracování žádosti. Na samotné výjezdy studentů se lépe hodí stipendijní program 2a a rovněž samotné zdůvodnění vyplácení peněz na cestovné na doposud nejisté akce nepůsobí příliš důvěryhodně. Lepší variantu by dle mého představovalo udělení paušální částky pro každého z organizátorů/stabilních debatérů jakožto odměny, nicméně to zase není umožněno tím, že o stipendium žádají pouze dva žadatelé, mezi kterými navíc nejsou zahrnuti hlavní organizátoři debatního klubu na FSS.',	'firstRating'),
(38,	76,	0,	'Ačkoliv se nejedná o přímo \"akademickou\" aktivitu, věřím, že je vhodné podporovat i kulturní seberealizaci studentů FSS. Na žádosti oceňuji zejména střízlivé vyčíslení nákladů na bicí soupravu. ',	'firstRating'),
(36,	76,	0,	'Radio R je stabilním studentským spolkem na FSS, které si kvalitní zázemí určitě zaslouží.Rovněž i cenové relace jsou dle mého plně v pořádku.',	'firstRating'),
(37,	76,	0,	'Vzhledem k tomu, že finanční odměna má záviset na počtu uskutečněných akcí, nepovažuji za úplně šťastné žádat o finanční ohodnocení pro jednotlivé organizátory před jejich uskutečněním.. Program by spíše měl sloužit jako finanční ohodnocení za provedenou práci, nikoliv jako motivace k tomu tuto práci vykonat. Ačkoliv mnohé jiné projekty žádají o peníze (i na odměny) také před pořádáním akcí, vidím určitý rozdíl v tom, pokud je akce již v běhu s určitou zárukou toho, že se uskuteční, a tímto případem, kdy jsem z Vaší žádosti získal pocit, že toto je pouze Váš plán, nikoliv pevně daný program.\r\nJinak ale projektu fandím a v případě neuspění v tomto stipendijním kole doporučuji podat projekt znovu s reálnými výsledky jakožto argumenty. ',	'firstRating'),
(39,	76,	1,	'Troufám si tvrdit, že jednou ze základních dovedností každého žurnalisty-vydavatele by rovněž měla být i schopnost vytvořit takový ekonomický model, který bude dlouhodobě udržitelný, o čemž u tohoto modelu přesvědčen nejsem. Pokud by Halas prodával svůj časopis za 20 Kč (nižší cena dle mého neodpovídá snaze o vytvoření stabilního rozpočtu), obdrží za jedno číslo až 20 000 Kč a byl by tudíž v zisku. Za takovéto situace nechápu nutnost dotovat tisk časopisu, zvláště když dle garance se jedná o dotaci pouze za podzimní semestr. Cestu bych viděl ve zpětné žádosti s jasně stanovenými údaji o ziskovosti/ztrátovosti jednotlivých čísel či v žádosti jednotlivých členů redakce o ohodnocení své činnosti, kterou již pak podle své vůle mohou použít na dotaci časopisu.',	'firstRating'),
(33,	76,	0,	'Stipendijní program je určen pouze pro studenty FSS. Z Vaší žádosti nicméně vyplývá, že byste většinu finančních prostředků použili na dotace pro (zejména) mimobrněnské účastníky akce, což je dle mého položka, na kterou se tento stipendijní fond nehodí. Z položek v rozpočtu za obhájitelné považuji položky na poháry, cestovné pro rozhodčí a tisk. Proto toto mé nízké hodnocení v některých kategoriích',	'firstRating'),
(34,	77,	0,	'Seznamovací kurz je součástí skoro každé fakulty a měl by být i součástí oboru Sociální práce. Rozpočet projektu je přiměřený, vše dobře odůvodněné. \r\nNevidím moc veliký odborný přínos a rozvoj dovedností, jelikož se jedná pouze o seznamovací akci a všichni víme, jak to na takových akcích chodí. Nicméně projekt je to důležitý pro socializaci studentů a seznámení se s chodem fakulty. ',	'firstRating'),
(32,	77,	0,	'Dobrý projekt, který pomáhá studentům získat zkušenosti v zahraničí a přispívá k jejich rozvoji a prohloubení znalostí. \r\nFinanční rámec je přiměřený a dobře zpracovaný. ',	'firstRating'),
(33,	77,	0,	'Dobrý projekt, studenti se zdokonalí v mluveném projevu, získají potřebné sebevědomí při projevech na veřejnosti a celkově si zlepší svoje vystupování.\r\nRáda bych slyšela více o rozpočtu, bude se proplácet ubytování všem lidem a v plné výši..? To samé s jídlem, protože tyto položky jsou v projektu poměrně finančně náročné. ',	'firstRating'),
(35,	77,	0,	'Nemám žádných výhrad ani připomínek. Projekt je výborně naplánován a bude velice přínosným informačně i kulturně. ',	'firstRating'),
(31,	77,	0,	'Projekt je přínosný pro studenty v mnoha ohledech. Jejich vystupování ve společnosti bude na profesionální úrovni, budou schopni během momentu vymyslet raciolální důvody pro a proti určitému výroku a celkově rychle analyzovat.\r\nRozpočet je vzhledem k vynaloženému úsilí adekvátní. ',	'firstRating'),
(40,	77,	0,	'Projekt má veliký odborný přínos, rozvíjí dovednosti přispěvatelů a vede ke zvýšení informovanosti širokého spektra čnenářů. \r\nPřispěvateli do časopisu jsou jenom studenti FSS či i z jiných škol?',	'firstRating'),
(39,	77,	0,	'Halas má dlouhou historii a je mezi studenty oblíben. Ráda bych si nechala dovysvětlit další formy financování, jakou přesně očekávají finanční podporu od sponzorů a pod. ',	'firstRating'),
(37,	77,	0,	'Projekt mi přijde jako ne moc dobře realizovatelný a zapadá mi do množství dalších spolků s diskutabilním účelem existence. Polovina akcí je na Flédě, tedy jedná se o obyčejné studentské párty s jinou motivací. \r\n\r\nMáte garanta celého projektu?',	'firstRating'),
(36,	77,	0,	'Určitě bych podpořila zavedené a dobře fungující studentské rádio. Jeho kolturní přínos a propagace FSS je bezesporu veliká a byla by obrovská škoda, kdyby jenom kvůli financím muselo rádio omezovat svoji propagaci a činnost. \r\n',	'firstRating'),
(38,	77,	0,	'Ojedinělý projekt, do kterého jednotliví členové přispívají nekonečnou pílí, časem a schopnostmi. Suma, kterou žádají, je vzhledem k reálným cenám žádaného hudebního nástroje, ještě značně malá. ',	'firstRating'),
(37,	74,	0,	'Projekt MUNIE dokázal během své krátké historie, že je schopný fungovat a přilákat pozornost celouniverzitního studentstva.\r\n\r\nMUNIE získává finance z mnoha zdrojů. Mimo jiné z poplatlů členů. Mrzí mě, že v žádosti není uvedeno, z jakých je MUNIE financována a jakým podílem by se FSS podílela na celkové ceně pořádání předložených akcí. V této souvislosti mluvím především o materiálních nákladech. \r\n\r\nDále se domnívám, že by bylo dobré uvést celkový přibližný rozpočet akcí MUNIE, což je spojeno s předchozí poznámkou. Zpracování rozpočtu a vysvětlení položek my tedy přijde neúplné.\r\n\r\nNa druhou stranu kvituji snahu organizátorů o získání symbolické odměny pro dobrovolníky, kteří mají na starost pořádání akcí. Rád bych však věděl, zda se jedná o dobrovolníky z řad FSS. Jelikož se totiž MUNIE vztahuje spíše k univerzitě, než FSS, tak se domnívám, že pokud by měla FSS odměňovat práci studentů, mělo by jít o studenty FSS. Pro mě osobně nejasnost v tomto ohledu je důvodem pro snížení hodnocení.\r\n\r\nPoslední poznámka se týká propagace FSS. U takového projektu je možnost propagace FSS hůře představitelná a žadatel se této otázce v žádosti nevěnuje. Byl bych tedy rád, když by mohl na setkání s komisí podrobněji rozvést také tento aspekt projektu.     \r\n\r\nCelkově bych od žadatelů očekával při zpracování žádosti mnohem větší pečlivost. Chtěl bych, aby žádost byla mnohem podrobnější a vyjadřovala se lépe ke konkrétním kvalitám, které jsou komisí hodnoceny. Budu rád, když se žadatel/é dobře připraví na setkání s komisí a budu jim moci hodnocení zvednout.',	'firstRating'),
(35,	74,	0,	'Pro tento projekt nebudu hlasovat a to z následujících důvodů:\r\n\r\na) Pro Česko(-)slovenský týden jsem vykonával grafické práce, v rámci své živnosti, za které jsem dostal finanční odměnu.\r\n\r\nb) V žádosti je, mimo jiné, žádáno o finance na Masarykovu debatu a já jsem jedním z organizátorů projektu Masarykovy debaty. \r\n\r\n',	'firstRating'),
(40,	74,	0,	'Prvně bych chtěl říci, že si aktivit GP vážím a v poslední době se podle mého subjektivního názoru tyto aktivity ještě více zlepšují. Dlouhodobá úspěšná činnost GP je zárukou důvěryhodnosti projektu. Zároveň je evidentní, že zapojení do aktivit GP výrazně rozvíjí dovednosti dotyčných studentů. \r\n\r\nRád bych, aby žadatelé uvedli specifičtější definici \"dlouhodobě velmi dobré návštěvnosti\" webových stránek. Zajímala by mě konkrétní čísla čtenosti článků. Jelikož toto chybí, jsem nucen snížit hodnocení v oblasti odborné a kulrutní přínosnoti. Přestože je vznik kvalitních odborných článků přínosem sám o sobě, je nutné uznat, že velká čtenost by znamenala lepší hodnocení z mé strany.\r\n\r\nDále jsem nucen snížit hodnocení  za propagaci FSS. V žádosti nejsou dostatečně uvedeny způsoby, jakými je aktivitou GP propagována činnost FSS. Na druhou stranu je jasná spojitost se vzdělávací činností fakulty. Z tohoto hodnotím v dané kategorii třemi hvězdičkami. \r\n\r\nPřes výše zmíněné nedostatky velmi dobře hodnotím zpracování žádosti. Předložený dokument je totiž velmi podrobný a je z něj jasné, jak probíhá činnost GP a co od navrhovaného projektu můžeme očekávat. \r\n\r\nPokud dobře počítám, tak odměna za hodinu práce je v předložené žádosti cca 80 Kč. Rád bych se na setkání komise s veřejností zeptal žadatelů, zda by byli ochotni z tohoto nároku slevit. Především ve chvíli, kdy by díky tomu bylo možné podpořit některý další projekt, na který by jinak nezbývaly finance. Bylo by to jistě bráno jako dobré gesto, na druhou stranu považuji požadavek na 80 Kč/hodina za plně legitimní.  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n',	'firstRating'),
(34,	74,	0,	'Především bych rád řekl, že jde o vzorově zpracovanou žádost. Vše je velmi detailně zpracováno a dostatečně obhájeno. Nemám tedy výraznější připomínky. \r\n\r\nHodnocení snižuji pouze ve dvou kategoriích a to z těchto důvodů:\r\n\r\n- důvěryhodnost nemohu hodnotit maximálním možným počtem \"hvězdiček\". Přestože byla dokázány zkušenosti žadatelek (lektorek) z jiných projektů, je pro mě nenavazování na tradici podobného projektu jistou nevýhodou. Není to samozřejmě chybou organizátorů. Je velmi potřebné, aby se studenti snažili o nové věci. Jakmile však dosud nejsou vyzkoušeny, jsem nucen snížit důvěryhodnost o jeden stupeň.\r\n\r\n- z žádosti plyne, že pro účastníky kurzu (a jistě svým způsobem i organizátorky) budou mít aktivity také odborný přínos, což reflektuji hodnocením v podobě tří hvězdiček. Bohužel se domnívám, že odborný (či kulturní) přínos není takový, abych mohl dát lepší hodnocení. \r\n\r\nJak jsem již napsal výše, nemám k dalším kategoriím žádné připomínky. \r\n ',	'firstRating'),
(34,	72,	0,	'Velká pečlivost v přípravě tohoto projektu vyústila ve velmi kvalitní žádost.\r\nOceňuji podrobný popis programu a odůvodnění žádaných částek, stejně jako nastínění rozpočtu celé akce, které v tomto kole ještě nebylo povinné. \r\nDomnívám se, že váš kurz bude pro účastníky přínosem a měl by být podpořen.',	'firstRating'),
(37,	78,	1,	'nesplna formalne poziadavky -chyba potvrdenie od garanta\r\n\r\nznížiť príspevok',	'firstRating'),
(36,	78,	0,	'- grafika v súčasnosti tak ako je prezentovaná, znížiť odmenu\r\n- kódovanie webu (predpokladám že redakčný systém ak je, je free) znížiť odmenu, náročnosť 40 hod. je nereálna\r\n\r\nnutne preznetovat vysledky spatnaj vazby \r\n\r\nciel tohoto projektu je teda zaplatit odmenu grafikovi a koderovi z radov studentov?',	'firstRating'),
(38,	78,	0,	'koľko má členov? kto sú členovia?\r\nako funugje organizačne doteraz? - priestory, peniaze, nástroje, bicia súprava, reprodukcia zvuku\r\n\r\ndramaturgia, zameranie, ciel\r\n\r\nako to vyzerá s hraním na plesoch\r\n\r\nma to byt dlhodobé, aká je teda stratégia na ďalšie roky? \r\nzabezpečenie, vedenie..apod. ',	'firstRating'),
(39,	78,	0,	'navrhujem zlepšiť propagáciu, dložiť štatistiky čítanosti, návštevnosti webu a zlepšiť marketing\r\nznížiť sumu na 8000 CZ',	'firstRating'),
(40,	78,	0,	'prinosy stipendia teda su? Kriteria pre splnenie ciela?\r\nKto by rozhodol o prideleni penazi v zalohe (3000)? \r\n\r\nnavrhujem znizit prispevok\r\n',	'firstRating'),
(32,	72,	0,	'Žádost je dobře zpracovaná, poskytuje odpovědi na téměř všechny otázky, které jsou pro nás při hodnocení relevantní.\r\nK projektu bych měl jednu otázku, týkající se rozpočtu;\r\nZ čeho jsou vypočteny tak vysoké (2700,-) poštovní náklady? Jaký objem korespondence se za tyto peníze dá při vámi prováděných úkonech rozeslat?\r\n',	'firstRating'),
(31,	78,	0,	'aký je teda jasný cieľ použitia štipendia? a aké sú kritéria pre jeho zhodnotenie?\r\nprínos poskytnutia peňazí, konkrétne?\r\n\r\nrozpočet: na čo presne teda budú použité peniaze a kto o tom rozhodne?\r\n\r\n4 hodiny trvá zabezpečiť miestnosť?\r\nplatí sa za prenájom miestnosti?',	'firstRating'),
(35,	78,	0,	'bol naplnený cieľ projektu? )\r\naké boli kritériá pre overenie naplnenia ?\r\n\r\nprínosy jednotlivých členov?\r\nprečo nie je rozpoet rozpracovaný aspoň tak ako skrátená verzia prostriedkov od Vodafone?\r\n\r\nz coho boli platené propagacne materialy, kedze sa akcia uz uskutocnila?',	'firstRating'),
(33,	78,	0,	'Jasný cieľ a kritériá naplnenia. Prínosy. \r\n\r\n\r\nčasový plán príprav udalosti?\r\nchýba plán propagácie a pritiahnutia širšieho záujmu a povedomia\r\nje možné ušetriť (jedlo, ubytovanie)\r\n\r\nnutné preznetovať nejaké predchádzajúce výsledky, účasť, reakcie v médiách= zhodnotenie',	'firstRating'),
(32,	78,	0,	'zorganizovali řadu konferencí na FSS – aké? Čo boli výstupy/prínosy (a konkrétne vymenovať), koľko ľudí sa zúčastnilo apod. \r\nevaluačné štatistiky (keď ich robíte) , spätná väzba, štatistika už zúčastnených ľudí – ako participovali, čo vytvorili, kde a  koľko ľudí vycestovalo, celkový počet participantov (presne).. bolo by dobré ich prezentovať, aby sme vedeli posúdiť, či je Vaša práca prínosná.\r\nRozpočet – máte už skúsenosti s projektmi = chcem vidieť konkrétne čísla (aspoň priemerné), aké služby využívate v akom množstve...konkrétnejší finančný plán, čo sa deje s rezervou, kto rozhoduje.\r\nAké sú veľké položky z financovania z Európskeho  projektu a čo pokrývajú.\r\n\r\nPáči sa mi ako popisujete činnosti, ktoré musia byť vykonané.\r\nČo je teda cieľ? Aké sú prínosy projektu (deliverables)? Aké sú kritériá, že bol cieľ dosiahnutý? \r\nMyslím že kritériá: odborný prínos, rozvoj dovedností, propagácia FSS a realizácia študentmi FSS sú splnené v dostatočnej miere.  Mám iba výhrady k doloženému projektu- zdôvodneniu/plánu\r\n',	'firstRating'),
(33,	72,	0,	'K Vašemu projektu mám následující tři dotazy:\r\n1) Pro kolik účastníků je navržený rozpočet? Resp. kolik účastníků se na turnaj přihlásilo? Kolik jich bylo minule?\r\n2) Jak velký poplatek budou platit samotní účastníci?\r\n3) Jakým způsobem řešíte ubytování?\r\n',	'firstRating'),
(34,	78,	0,	'jasne popísať hlavný cieľ a vedľajšie ciele\r\na kritériá ich naplnenia\r\n\r\nrozpísať prínosy jednotlivo\r\n\r\naké sú iné zdroje financovania?',	'firstRating'),
(35,	72,	0,	'Děkuji za skvěle připravený týden, podobné akce by se určitě měly konat častěji.\r\nMěl bych dotaz k rozpočtu projektu; Jaká byla skutečná cena za tisk v Copy General (předpokládám, že když Č-S týden již skončil, je toto číslo již známé)?',	'firstRating'),
(31,	72,	0,	'',	'firstRating'),
(40,	72,	0,	'Projekt je dobře zpracovaný, jsem pro udělení podpory v žádané výši.\r\nChtěl bych se dotázat, z jakých zdrojů financujete odměny vítězům soutěží?',	'firstRating'),
(39,	72,	0,	'Oceňuji, že jste po březnovém kole začali řešit náklady tisku a celá záležitost se někam posunula.\r\nZároveň se však domnívám, že remitenda ve výši 70% nákladu (dosahuje-li prodej stále cca 300 kusů) je při Vašem skromném rozpočtu pořád dost vysoká.\r\nKolik by vás stál tisk například 500 kusů?',	'firstRating'),
(37,	72,	0,	'Obdivuji, jak jste dokázali během poměrně krátké doby vybudovat na MU neopominutelnou organizaci.\r\nMoje otázky směřují k rozpočtu projektu, respektive administrativě:\r\n1) Kdo budou hlavní organizátoři akcí? Jde o studenty FSS?\r\n2) Za kolik a v jakém množství vyrábíte tiskové materiály a nakupujete upomínkové předměty? ',	'firstRating'),
(36,	72,	0,	'Jsem rád, že se rádio konečně dostalo k vytvoření srozumitelných webových stránek. \r\nDomnívám se, že tento bohulibý záměr by měl být podpořen.',	'firstRating'),
(38,	72,	0,	'Taneční orchestr MU je dle mého názoru nadějný projekt, který by se měl pokusit zapracovat na sebepropagaci a dostat se tak do povědomí širší skupiny studentů MU.\r\nByl bych rád, kdyby byl po nepodpoření pro vyčerpání prostředků v březnovém kole v tomto kole nákup bubnů podpořen. ',	'firstRating'),
(34,	72,	1,	'Vzhledem k odstoupení projektu ze stipendijního kola ho nelze hodnotit. \r\nVnímám to z Vaší strany jako vhodný krok.',	'secondRating'),
(37,	72,	1,	'Vzhledem k odstoupení projektu ze stipendijního kola ho nelze hodnotit. \r\nVnímám to z Vaší strany jako vhodný krok.',	'secondRating'),
(34,	76,	1,	'Po dohodě s organizátory projekt pro toto kolo stažen.',	'secondRating'),
(37,	76,	1,	'Autoři projekt stáhli.',	'secondRating'),
(32,	76,	0,	'Bez žádných dalších připomínek',	'secondRating'),
(35,	76,	0,	'Z důvodů vlastního zapojení do projektu nehodnotím.',	'secondRating'),
(40,	76,	0,	'Z důvodu vlastního zapojení do projektu nehodnotím.',	'secondRating'),
(38,	76,	0,	'Velmi oceňuji snížení i již předem racionální částky. Plně projekt podporuji.',	'secondRating'),
(36,	76,	0,	'K projektu jsem neměl žádné výhrady ani v prvním kole, ani nyní. ',	'secondRating'),
(39,	76,	0,	'Rozhodl jsem se nakonec projekt neblokovat, zejména z důvodu vskutku dlouhé historie Halasu a jeho pravděpodobným existenčním ohrožením bez tohoto příspěvku. Nicméně nedokáži si představit, že bych pro případná další grantová kola podpořil tisk časopisu, který nakonec z 40 - 50% skončí nevyužit. Jakkoliv jsem schopen uznat argumenty a kvalitě tisku a způsobu prodeje, množství tisku se mi zdá i nadále neobhajitelné. ',	'secondRating'),
(33,	76,	0,	'Velmi oceňuji snahu autorů přijít s konstruktivním řešením! ',	'secondRating'),
(31,	76,	0,	'Pro příště opravdu doporučuji přehledněji zpracovaný rozpočet.',	'secondRating'),
(37,	74,	1,	'Žadatelé svou žádost stahují.',	'secondRating'),
(34,	74,	1,	'Žadatelka se rozhodla žádost v tomto stipendijním kole stáhnout',	'secondRating'),
(38,	74,	0,	'Velmi dobrý projekt, který mě zaujal i v minulém stipendijním kole. Trvá jen má výhrada vůčí potenciálu propagace FSS. ',	'secondRating'),
(39,	74,	0,	'Znovu bych rád zopakoval, že pozitivně hodnotím změny, které v žádosti Halasu proběhly oproti minuolému stipendijnímu kolu. Domnívám se, že je projekt v současné podobě mnohem udržitelnější. Stejně tak však trvá má výtka k nákladu časopisu, který je 1000 kusů, přestože reálná \"prodejnost\" je cca 300-400 kusů. Ani na setkání s veřejností nebyl dostatečně dobře obhájen toto rozhodnutí. Argumentuje se malým rozdílem v ceně (1000 Kč), ale každé ušetření je pro projekt pozitivní. Především ve chvíli, kdy není dostatečně kvalitní plán využití neprodaných výtisků. ',	'secondRating'),
(36,	74,	0,	'Vytvoření nového webu pro RadioR považuji za velmi přínosné. Stále však nepovažuji odměny pro grafika (to především) a programátora za adekvátní. Proto snižuji hodnocení v kategorii \"rozpočet\". ',	'secondRating'),
(40,	74,	0,	'Velmi dobrý projekt. Má především velký odborný přínos pro autory i celou akademickou obec. Žádost byla kvalitně zpracována. Hodnotím čtyřmi hvězdičkami pouze v kategorii \"propagace FSS\", kde sice dochází k vysoké propagaci akademických aktivit na FSS, ale jinak bych v propagaci viděl i vyšší potenciál, který není plně využit. ',	'secondRating'),
(33,	74,	0,	'Dobrý projekt, který rozvíjí dovednosti účastníků a je výbornou příležitostí k propagaci FSS. Obhájení na setkání s veřejností bylo velmi přínosně, protože vyjasnilo mnoho nedostatků, které se objevily v žádosti. ',	'secondRating'),
(31,	74,	0,	'U tohoto projektu mi vadilo poněkud chaotické zpracování žádosti. Nejasnosti, které jsem měl po prvním hodnocení se však vyjasnily během při setkání se Stipendijní komisí. Především tedy pozitivně hodnotím rozvoj dovedností účastníků debatního klubu. V rámci turnajů také dochází k výborné propagaci FSS. ',	'secondRating'),
(32,	74,	0,	'Skvělý projekt, jehož žádost byla výborně připravane. Některé nejasnosti (cena korespondence), byly dostatečně obhájeny na setkání se Stipendijní komisí. Nemám proto k projektu žádné výhrady a dávám plné hodnocení ve všech kategoriích.',	'secondRating'),
(35,	74,	0,	'Jak jsem uvedl v prvním kole, tento projekt nehodnotím. ',	'secondRating'),
(32,	77,	0,	'Moji plnou podporu máte i ve druhém hodnocení, dobrý projekt, finanční rámec přiměřený. Nemám výhrad. ',	'secondRating'),
(34,	77,	1,	'Viz předchozí domluva.',	'secondRating'),
(33,	77,	0,	'Po vylepšení rozpočtu a zavedení účstnického poplatku je projekt mnohem lépe obhájitelný. Požadovaný finanční rámec je únosný. Projektu se zúčastní na 60 lidí a z toho kolem 20 přímo studentů z FSS, což je jednak skvělá účast i propagace pro FSS. ',	'secondRating'),
(35,	77,	0,	'Nemám výhrad. Dobrý projekt vhodný pro udělení finanční podpory. ',	'secondRating'),
(31,	77,	0,	'Podle mého názoru je zde malá část studentů, která by využila přidělené peníze. Pouze osm studentů FSS se má turnaje zúčastnit a když to srovnám například s projektem Brno Open, kde se ho zúčastní kolem 20 studentů FSS a přitom pořadovaná částka je skoro stejná, projekt Debatní klub pro mě má menší prioritu. ',	'secondRating'),
(40,	77,	0,	'Projekt hodnotím kladně, má nesporný odborný přínos. Do budoucnosti si možná lépe promyslete, o jakou částku chcete žádat, abyste po prvním zasedání požadovanou částku opět nesnižovali. ',	'secondRating'),
(39,	77,	0,	'Halas podporuji, ale nelíbí se mi nešetrnost s finančními prostředky. Rozhodně bych byla pro zrušení naprosto zbytečného výtisku 1 000 kopií. Už tím ušetříte nějaké peníze a vzhledem k tíživé finanční situaci časopisu se hodí každá koruna. Dále váš nápad kreativně zpracovat nepoužité časopisy a vystřihovat z nich atd. mi přijde jako snižování prestiže Halasu. \r\nMyslím, že by se daly najít i další finanční prostředky, nalákat více sponzorů a celkově se stát nezávislými na finančních prostředcích fakulty. \r\nHalas ale podpořím, podle mě k fakultě jednoznačně patří. ',	'secondRating'),
(37,	77,	1,	'Viz naše předchozí domluva. ',	'secondRating'),
(36,	77,	0,	'Nemám výhrad, dobrý projekt. ',	'secondRating'),
(38,	77,	0,	'Ojedinělý projekt, určitě stojí za podporu. Zamyslete se více nad propagací FSS, minimálně ta nálepka na bubnech :) ',	'secondRating'),
(38,	72,	0,	'Vrtá mi hlavou, jakým způsobem zvládáte snížit žádanou částku postupně až na polovinu, ačkoliv se jedná o materiál.\r\nNicméně cením si Vaší činnosti a doufám, že se na vás v tomto kole již dostane.',	'secondRating'),
(36,	72,	0,	'Rádio R dělá dobré jméno FSS, odměna v této výši mi pro tvůrce webu přijde adekvátní.',	'secondRating'),
(39,	72,	0,	'Cením si snížení nákladů na tisk. Domnívám se ale, že Halas by měl do budoucna učinit určitá opatření ke snížení remitendy či alespoň zvýšení zisku za v současné době prodávané množství.\r\nMám tím na mysli zejména:\r\n1) zavedení prodejní ceny (nikoliv dobrovolných příspěvků)\r\n2) nalezené čtenářské základny i mimo FSS (respektive zvýšení atraktivity článků pro jakékoliv čtenáře mimo fakultu).\r\n3) Důraz na získání potřebného objemu inzerce\r\nRád zvedám ruku pro podpoření doplacení Vašich nákladů v tomto kole, ale z dlouhodobého hlediska je částka k doplacení na jedno číslo hodně vysoká...',	'secondRating'),
(40,	72,	0,	'Vítám Vaši nabídku snížení žádané částky a děkuji za objasnění financování soutěží.',	'secondRating'),
(35,	72,	0,	'Děkuji za upřesnění ceny tisku. Projekt si dle mého názoru zaslouží naši podporu',	'secondRating'),
(32,	72,	0,	'Děkuji za zodpovězení otázek z prvního kola. Přeji hodně úspěchů ve vysílání studentů a rektorů na cesty ;-)',	'secondRating'),
(33,	72,	0,	'Cením si zavedení poplatku za účast v turnaji a následného snížení žádané částky.',	'secondRating'),
(31,	72,	0,	'Oceňuji Vaši lokální i misijní činnost. Myslím, že by bylo záhodno mít k žádosti jasnější rozpočet.',	'secondRating'),
(34,	78,	0,	'nedoporučené v tomto kole',	'secondRating'),
(37,	78,	1,	'',	'secondRating'),
(32,	78,	0,	'',	'secondRating'),
(33,	78,	0,	'',	'secondRating'),
(35,	78,	0,	'',	'secondRating'),
(39,	78,	0,	'',	'secondRating'),
(40,	78,	0,	'',	'secondRating'),
(38,	78,	0,	'',	'secondRating'),
(31,	78,	0,	'',	'secondRating'),
(36,	78,	0,	'',	'secondRating'),
(41,	76,	0,	'Musím ocenit velmi dobře sepsanou a podrobnou žádost (zejména položky rozpočtu), která dle mého názoru může sloužit jako příklad jiným žádostem. Rovněž velice oceňuji velmi střízlivé vyčíslení nákladů. Projekt hodnotím velmi pozitivně a plně ho podporuji. Na deliberaci prosím pouze o vysvětlení, pro koho je určeno cestovné Praha - Brno. ',	'firstRating'),
(43,	76,	0,	'Oceňuji podrobnou žádost s jasně stanovenými cíli. Mám problém se dvěma faktory: 1. Odměna 60 Kč/hod mi přijde poměrně vysoká, proto bych žadatelky na deliberaci požádal o její zdůvodnění.  2. Kolegyně Janků není studentkou FSS MU a neměla by tudíž příjemcem stipendia z tohoto programu. Z tohoto důvodu snižuji hodnocení v příslučných kategoriích.',	'firstRating'),
(42,	76,	0,	'Oceňuji srozumitelnější rozepsání rozpočtu oproti minulému grantovému kolu. Debatní klub je stabilní platforma FSS, kterou plně podporuji.Žádaná částka mi nicméně příjde poměrně vysoká, proto pro deliberaci vyzývám žadatele, aby se zamyslel nad tím, zda by nešlo částku u některých položek snížit. ',	'firstRating'),
(46,	76,	0,	'Principielně nemám s tímto projektem vůbec žádný problém a jsem pro jeho podporu, nicméně žádosti značně ubírá na kvalitách nedostatek informací. Tedy např. kolik studentů se ho bude účastnit, jak bude probíhat, co bude výsledkem...atd. Rovněž bych uvítal podrobnější rozepsání rozpočtu.',	'firstRating'),
(45,	74,	0,	'Formátu Pecha Kucha fandím a chápu ho jako prostředek pro získání zajímavavých informací a zároveň zlepšování prezentačních schopností. \r\n\r\nZ žádosti mi však není přesně jasné, jak by byly prezentace tématicky vybírány. Byl bych proto rád, když by to žadatelé ujasnili. Bylo by tak lépe možné hodnotit přínost celé akce. \r\n\r\nZároveň mě mrzí, že si žadatelé nedohodli odpuštění nájmu za místnost. Doporučuji, aby tak do setkání s komisí učinili.\r\n\r\nZ jakého důvodu máte do rozpočtu zahrnutou položku 4 (odměna pro prezentující mimo FSS, vyučující FSS)? Proč máte v úmyslu tyto prezentující finančně odměňovat? \r\n\r\n',	'firstRating'),
(50,	74,	0,	'Tento projekt nehodnotím, protože pro Demagog příležitostně pracuji. ',	'firstRating'),
(41,	74,	0,	'Proti projektu nemám výraznějších připomínek. Především pozitivně hodnotím, že si žádáte o velmi malou sumu peněz a jste schopni díky ní uspořádat skutečně velkou a přínosnou akci. Žádost je kvalitně připravena a rozpočet je velmi podrobně rozepsaný. \r\n',	'firstRating'),
(46,	74,	0,	'Zajímavý projekt. Mrzí mě však velmi stručná podoba žádosti. Domnívám se, že by si projekt zasloužil lepší prezentaci. Žádost pak neodpovídá dostatečně na všechny kategorie hodnocení, což mě nutí k snižování hodnocení. Doporučuji tedy na setkání s komisí především důkladnou přípravu prezentace projektu a všech jeho aspektů. ',	'firstRating'),
(48,	74,	0,	'Co konkrétně zahrnujete pod rozpočtovou položku 2? Co znamená položka 3? \r\n\r\nProč není v žádosti uvedeno, kolik budou stát lístky? Kolik tedy očekáváte, že se vám vrátí peněz z lístků? Budete mít i další náklady? Předpokládám, že ano, když potřebujete prodat 200 lístků, aby se vám vrátili náklady. Lístek totiž stojí 90 Kč, což při počtu 200 kusů dělá 18 000 Kč za prodej lístků. Co je tedy dalším nákladem. Upozorňuji, že součástí pravidel hodnocení této komise je povinnost žadatelů předložit celý rozpočet akce (ne jen požadované částky).  ',	'firstRating'),
(49,	74,	0,	'Projekt velmi přínosný. Tím, že navazuje na již proběhlou událost, je jásná je důvěryhodnost. Bohužel musím snížit hodnocení v některých kategoriích. \r\n\r\nV rozpočtu uvádíte částky za cestovné řečníků a občerstvení. O jaké množství řečníku se jedná? Odkud očekáváte, že přijedou? Bez těchto informací nejsem schopen posoudit ospravedlnitelnost žádaných částek. \r\n\r\nStejně tak není v žádosti dostatečně obhájen přínos projektu vzhledem k propagaci FSS.  \r\n\r\nDomníváte se, že odměna cca 80 Kč na hodinu je adekvátní pro dobrovolnický studentský projekt? \r\n',	'firstRating'),
(44,	74,	0,	'Jedná se o důvěryhodný projekt, který organizuje spolek Be International. Nemám výrazné negativní připomínky. Snižuji hodnocení v rozvoji praktických dovedností, což však vychází z charakteru akce a není nutné to chápat jako výtku. ',	'firstRating'),
(47,	74,	0,	'Kvalitně napsaná žádost od tradičního spolku FSS. Mrzí mě jen to, že v rozpočtu nejsou podrobněji rozepsané jednotlivé položky rozpočtu. Snižuji také hodnocení v propagaci FSS, protože ta není žádostí dostatečně obhájena a nemyslím si, že by z charakteru projektu tato propagace logicky vyplývala. ',	'firstRating'),
(42,	77,	0,	'Je potřeba zvážit, jestli není lepší o fnanční podporu žádat až zpětně, i když přihlédneme k motivaci jet na turnaj. Pokud se přihlásí kvůli získanému stipendiu mnoho lidí, zase finance nebude stačit pro všechny účastníky. ',	'firstRating'),
(50,	77,	0,	'Peníze chcete využít na mimořádné odměny za nadstandartní práci pro stážisty nebo pro jejich regulérní odměnu za práci? (Jde mi o to, zda stážisti dostávají za svoji práci finanční odměnu a toto stipendium by byla nadstandartní odměna či nikoli)',	'firstRating'),
(45,	77,	0,	'Přijde mi, že máte nadsazený rozpočet. Vše by se dalo trochu osekat. ',	'firstRating'),
(41,	77,	0,	'Zde mi přijde, že je rozpočet zase moc nízký, nebude málo občsrstvení a málo propagačních materiálů?',	'firstRating'),
(46,	77,	0,	'Nemám výhrad, jenom mě zajímá, jaká je propagace FSS?',	'firstRating'),
(43,	77,	0,	'Jaká je propagace FSS? \r\nJaké procento studentů FSS předpokládáte, že se přednášky zúčastní?\r\nMáte i jiné zdroje financování?',	'firstRating'),
(48,	77,	0,	'Kolik stojí jeden lístek na ples?\r\nKolik lidí přišlo minulý rok? \r\nKolik vás celkem bude ples stát (i s honorářem pro kapely...)?\r\n',	'firstRating'),
(49,	77,	0,	'Žádáte po nás skoro polovinu financí, se kterou můžeme v tomto kole disponovat. Náklady jsou přehnaně vysoké - začnu už s odměnou 80 Kč/hod pro organizátory. Při zachování vašeho současného rozpočtu projekt nepodpořím. \r\n\r\nKolik přednášejících bude na akci vystupovat?\r\nMusí mít občerstvení za 4 000 Kč? ',	'firstRating'),
(47,	77,	0,	'Náklady opět trochu vysoké. Žádali jste už v minulosti o stipendium?',	'firstRating'),
(44,	77,	0,	'Více rozveďte rozpočet.\r\n',	'firstRating'),
(43,	74,	0,	'Předně bych chtěl poděkovat za příkladně zpracovanou žádost. Je poznat, že žadatelka zpracování věnovala dostatek času a energie.\r\n\r\nZ formální kvality žádosti také vyplývá mé hodnocení. Žádost odpovídá téměř na všechny mé otázky.\r\n\r\n\r\n',	'firstRating'),
(42,	74,	0,	'Jsem rád, že DKMU si vzalo z minulé žádosti ponaučení a napsalo tuto novou mnohem kvalitněji. Za mě osobně tomu jednoznačně odpovídá také hodnocení. Nemám negativní připomínky. ',	'firstRating'),
(50,	72,	1,	'Projekt bohužel musím označit jako nesplňující formální kritéria, neboť dosud nebylo reportováno využití peněz, přidělených ve stipendijním kole březen 2012.\r\nMimo toho nesplňujete i formální kritérium přiložení rozpočtu celého projektu, nejen žádané části (odměny).\r\n\r\nPro příště by mě také potěšilo, kdyby žádost nebyla od té minulé okopírované do té míry, že se tam o březnu 2012 mluví v budoucím čase, když už chcete takto vysokou částku ;-)',	'firstRating'),
(50,	76,	0,	'Demagog.cz bezesporu patří k nejúspěšnějším projektům na FSS. Na druhou stranu osobně dávám přednost podpoře projektů, kteří peníze kromě odměn potřebují i na samotné provedení projektu a ne pouze na odměny. Z toho důvodu, a rovněž také díky tomu, že (jako celek vysoké)\r\nodměny ve výší 15 000 Kč nejsou více nikterak rozepsáný, snižují své hodnocení v přílušných kategoriích. Osobně bych velmi ocenil snížení žádané částky na cca 10 000 Kč.',	'firstRating'),
(45,	76,	1,	'V tomto kole projekt nepodporuji z důvodů zahrnutí nákladů, které dle mého názoru do takovéto žádosti vůbec nepatří. Jmenovitě se jedná zejména o položku \"pronájem místností\", která je vzhledem k možnosti vypůjčit si místnost na FSS absolutně irelevantní, a odměny pro účastníky střetnutí (bylo by relevantní pouze v případě, že by peníze šli lidem z FSS a v takovém případě nepovažuji účast na takovéto akci za dostatečně náročnou k tomu, aby si dotyčný zasloužil finanční odměnu). Rovněž mi lehce vyšší příjde i odměna pro organizátory. Doporučoval bych ji lehce snížit na úroveň 2000 Kč. ',	'firstRating'),
(48,	76,	0,	'Se samotným způsobem vynaložených peněz nemám nejmenší problém a plně jej podporuji. Nicméně velmi nedůvěryhodně/abstraktně působí samotné zpracování rozpočtu, a to doslova u všech položek.Samotné náklady na tisk lístků mi příjdou nesmyslně vysoké, rozhodně přehnaná je částka na propagaci, vůbec nevím, co si představit pod pojmem \"pokladna\" a o jakých ozdobách zde mluvíme. Prosím proto žadatelky, aby si pro deliberaci připravili podrobné informace o této oblasti, aby bylo možné pro druhé kolo hodnocení zvýšit. ',	'firstRating'),
(44,	76,	1,	'Projekt v tomto kole nepodporuji z několika důvodů: 1. Projekt se má uskutečnit až v jarním semestru a nechápu tedy, proč se o peníze žádá již teď 2. Samotná žádost obsahuje několik velmi snadno se měnících proměnných (např. ubytování v Brně = položka, kterou absolutní většina účastníků nevyužije + nejsem přesvědčen, že by se z tohoto stipendijního fondu mělo proplácen ubytování lidem z Prahy) 3. Takto dopředu nevidím žádné záruky toho, že se projekt skutečně uskuteční v plánovaném rozsahu. \r\n\r\nDoporučuji projekt pro toto kolo stáhnout a žádat znovu v jarním semestru s alespoň částečenými výsledky a daty na podložení žádosti. Popřípadě se nechám rád přesvědčit na deliberaci :)',	'firstRating'),
(47,	76,	0,	'Prosím žadatelé, aby při deliberaci vysvětlily položky \"náklady\" (např. u filmového klubu) a rovněž proč považují odměnu 70 Kč/hod za přiměřenou své práci. ',	'firstRating'),
(49,	76,	1,	'Projekt v tomto kole nedoporučuji k podpoře, jelikož předloženou žádost považuji za velmi plytkou a informačně nedostatečnou. Ze samotné žádosti jsem se dozvěděl pouze to, že cílem organizátorů je přizvat na FSS lidi z praxe, kteří mají studentům sociologie vyprávět o tom, jak se sociologie dělá v praxi. Více jsem se z obsahu nedozvěděl. Za tento počin žádají žadatatelé 20 000 Kč na položky, které mnohdy působí poměrně nedůvěryhodně. Proto bych rád věděl: 1. Pro kolik řečníků jsou vlastně částky doprava/občerstvení vlastně určeny a co všechno budou zahrnovat? 2. Z jakého důvodu preferujete telefonní komunikaci před e-mailem? 3. Co všechno se skrývá pod oněmi 31 hodinami práce a považujete tuto práci za tak náročnou že je dle Vašeho názoru částka 80 Kč/hod adekvátní? V případě kvalitního zodpovězení otázek na deliberaci rád svůj názor na tento projekt změním. ',	'firstRating'),
(45,	72,	0,	'Nápad se mi zamlouvá, tento netradiční formát prezentací bude pro účastníky jistě přínosný.\r\n\r\nMěl bych čtyři otázky:\r\n1) Co jste již udělali pro akci na konci listopadu? Kolik máte přihlášených přednášejících a kolik účastníků? Jak akci propagujete?\r\n2) Kolik přednášejících bude chtít za svou přednášku honorář a jak vysoký?\r\n3) Kolik prezentací se na večírku uskuteční? Jak dlouho celý večer trvá?\r\n4) Jak jste vypočítali náklady na propagaci? Kolik čeho chcete tisknout?',	'firstRating'),
(48,	72,	1,	'U Vaší žádosti jsem bohužel nenalezl rozpočet celé akce (v žádosti uvádíte jen využití žádaných peněz).\r\nCelkový rozpočet je nejen formálním kritériem pro toto kolo, ale i nesmírně podstatným dokumentem pro hodnocení akcí, která mají takto vysoké ambice a mimo výdajů mají i příjmy (ve Vašem případě z prodeje lístků).',	'firstRating'),
(49,	72,	1,	'Vámi uvedená čísla v rozpočtu žádosti jsou až \"nápadně kulatá\" a není z nich příliš jasné, jakým způsobem byla vypočtena. Prosím tedy o předložení celého rozpočtu, obsahujícího metodiku výpočtu částek. Vzhledem k současné podobě označuji jako nevhodné k podpoře.\r\n\r\nK samotnému projektu bych se chtěl zeptat na dvě věci;\r\n1) Jak úspěšná byla minulá akce? Kolik studentů na ní dorazilo?\r\n2) Zahájili jste už nějak propagaci akce, kterou plánujete na začátku prosince?',	'firstRating'),
(46,	72,	0,	'Váš rozpočet je velmi obecný, prosím o rozšíření o metodiku výpočtu a zodpovězení otázek.\r\n\r\n1) Jak je možné, že se za takovouto bohulibou činnost platí v klášteře nájem? To už se i žebravý řád minoritů transformoval v tržní strukturu? Zkoušeli jste se s řeholníky dohodnout na prominutí nájmu? Jednali jste s konkurenčními objekty?\r\n2) Proč se mění žadatel projektu? Budou se na projektu podílet studenti, kteří u nás získali podporu pro Velikonoční dílničky?\r\n3) Kolik čeho chcete za kolik tisknout?\r\n4) Jak budete řešit propagaci? Kde budete shánět účastníky?',	'firstRating'),
(41,	72,	1,	'Žádost hodnotím jako nevhodnou k podpoře, neboť jeden z žadatelů, Bc. Tomáš Chalupský, není studentem FSS. ',	'firstRating'),
(42,	72,	0,	'Projektu jsem nucen snižovat hodnocení v kategoriích, týkajících se pořadatelů, a to proto, že celý projekt je o účasti, nikoliv o pořádání akce.\r\nJakým způsobem budete hradit účast debatérů, kteří se přihlásí nad rámec Vašeho odhadovaného počtu (8 a 10 účastníků)?',	'firstRating'),
(47,	72,	1,	'Vzhledem k absenci kompletního rozpočtu akce vyhodnocuji jako nevhodné k podpoře. \r\n\r\nInspirací k tomu, co by ještě mohlo být vyřešeno by mohly být například tyto otázky:\r\n1) Jak máte ošetřená autorská práva k promítaným filmům?\r\n2) Kam se jede na exkurzi?\r\n3) Co jsou akce, nespadající pod konkrétní projekt?\r\n4) Kde se berou náklady filmového klubu a kulatého stolu? Z čeho vychází? Kdo kam bude cestovat a pro kolik lidí se kupuje občerstvení?\r\n5) Jakou jste měli v minulosti účast na podobných akcích?',	'firstRating'),
(43,	72,	0,	'Velmi dobře připravený projekt, doporučuji k podpoře.\r\n\r\nPozn.: v žádosti máte chybu - uvádíte, že v roce 2002 soud zakončil deset let své existence',	'firstRating'),
(44,	72,	0,	'Idea žádosti je dobrá, myslím, že tento projekt má smysl a měl by být podpořen.\r\nCo by mě zajímalo je metodika výpočtu částek v rozpočtu, které vypadají jako zaokrouhlené/odhadnuté.\r\n\r\n1) Kdo kam bude cestovat? Z jakých cen jste náklady na cesty vypočetli?\r\n2) Kolik jakých propagačních materiálů budete tisknout? Jaká je cena za kus?',	'firstRating'),
(42,	78,	0,	'navrhujem poskytnúť podporu len na zápisné (čo preferujem)..alebo naopak len na cestu pre študentov FSS',	'firstRating'),
(50,	78,	0,	'',	'firstRating'),
(41,	78,	0,	'',	'firstRating'),
