(43,	78,	0,	'',	'firstRating'),
(48,	78,	0,	'znížiť nároky na financie\r\nčo všetko pokryje vstupné? a pri väčšej účasti ako 200 ľudí? čo so ziskom?',	'firstRating'),
(49,	78,	0,	'náklady na telefón?\r\nkto bude jesť občerstvenie? veľká suma\r\nnadnesená odmena pre organizátorov\r\naké sú iné zdroje financovania',	'firstRating'),
