(46,	78,	0,	'treba doplniť propagaciu FSS, zlepšiť rozpočet a určit ciele a kritéria uskutočniteľnosti',	'firstRating'),
(42,	76,	0,	'',	'secondRating'),
(50,	76,	1,	'Z důvodů nesplnění formálních podmínek (nedodána hodnotící zpráva projektu z minulé žádosti) není možné tento projekt v tomto kole podpořit.',	'secondRating'),
(44,	76,	0,	'Děkuji organizátorům za zodpovězení dotazů a za konstruktivní přístup v případě žádané částky. Nyní již nemám s projektem žádný problém.',	'secondRating'),
(41,	76,	0,	'Velmi dobrý projekt s velmi dobrou žádostí.',	'secondRating'),
(45,	76,	0,	'Děkuji žadatelům za konstruktivní přístup upravení položek rozpočtu. Nyní již s ním nemám nejmenší problém a přeji projektu jeho úspěšné provedení. ',	'secondRating'),
(49,	76,	0,	'Děkuji za kompletní přepracování rozpočtu. Velmi oceňuji zejména to, že jste se vzdali osobní odměny pro to, aby projekt vůbec měl šanci v tomto kole získat peníze. Nyní již s ním nemám problém a doufám, že se na vás dostane. ',	'secondRating'),
(48,	76,	0,	'Ačkoliv si stále myslím, že by bylo lepší žádost podat až zpětně v jarním kole, vaše argumenty chápu. Navíc oceňuji snížení žádané částky. ',	'secondRating'),
(43,	76,	0,	'Již v prvním kole velmi dobrá žádost, která navíc byla dobře obhájena při deliberaci.',	'secondRating'),
(46,	76,	0,	'Ačkoliv si myslím, že by se náklady dali lehce snížit, projekt samotný se mi velmi líbí. Jen při své akci nezapomeňte na propagaci FSS :)',	'secondRating'),
(47,	76,	0,	'Žádost Studentské sekce se bohužel po deliberaci vykristalizovala jako jedna z nejméně vysvětlených a obhájených. Formální požadavky splňuje, proto není důvod projekt nepodpořit, na druhou stranu oproti jiným žádostem v tomto kole je tato bohužel vskutku slabší. ',	'secondRating'),
(42,	77,	0,	'Je problém, že žádáte o peníze ještě před akcí a nevíte přesný rozpočet, každopádně dobrý projekt. \r\n\r\n',	'secondRating'),
(50,	77,	0,	'Nelíbí se mi zpracování žádosti stylem Ctrl C, Ctrl V. Jinak je projekt určitě přínosný. ',	'secondRating'),
(45,	77,	0,	'Nemám výtek.',	'secondRating'),
(41,	77,	0,	'Přijatelný rozpočet i dobré zpracování. ',	'secondRating'),
(46,	77,	0,	'Nemám dalších poznámek k projektu, hodnotím pozitivně.',	'secondRating'),
(43,	77,	0,	'Pozitivně hodnotím i snížení rozpočtu. ',	'secondRating'),
(48,	77,	0,	'Pozitivní je snížení rozpočtu, ale i přes to je problematické o peníze žádat před plesem, i když chápu vaše důvody. ',	'secondRating'),
(49,	77,	0,	'Snížení rozpočtu je super, nemám výhrad. ',	'secondRating'),
(47,	77,	0,	'I přes nepatrné snížení honoráře za akce mi přijde nadsazený. ',	'secondRating'),
