(50,	72,	1,	'Vzhledem k absenci závěrečné zprávy hodnotím jako nevhodné k podpoře. \r\n\r\nE-mail, oznamující ultimátum pro všechny absenční zprávy se samozřejmě nedá vykládat jako dočasná ignorace tohoto nedostatku, ale spíše jako upozornění na již dávno prošlé deadliny a možnost napravení této chyby (z čehož nelze vyvozovat, že dokud náprava neproběhne, budeme se tvářit, jako že se nic nestalo - to ani nemůžeme). \r\n\r\nDovolte mi vás na závěr ještě upozornit (abychom předešli možným dalším názorovým střetům), že pokud v tomto kole dostanete celkové nedoporučení k podpoře, hrozí Vám při nedodržení formálních kritérií v jakémkoliv dalším kole celkové vyřazení projektu.',	'secondRating'),
(48,	78,	0,	'',	'secondRating'),
(43,	78,	0,	'',	'secondRating'),
(47,	78,	0,	'stanovit si ciele, ich vyhodnotenie, casovy plan',	'secondRating'),
(46,	72,	0,	'Prezentace na deliberačním setkání Vašemu projektu bezesporu pomohla - do jisté míry jste objasnili rozpočet a prezentovali minulé úspěchy (malý důraz na historii projektu byl problémem, který skoro zamezil podpoře Velikonočních dílniček).\r\nOceňuji, že oproti minulým ročníkům seškrtáváte rozpočet o peníze na odměny, v budoucnu se o ně ale určitě nebojte žádat - je to běžná součást projektu.\r\n\r\nK rozpočtu do budoucna doporučuji žádat o exaktně vypočítané částky (1400 za propagaci a 5984 za materiál), ne o zaokrouhlené - na hodnotitele to pak působí jako skutečně objasnitelné náklady a ne odhady (což v tuto chvíli není váš případ, což se ale bohužel dozvídáme až u deliberace).',	'secondRating'),
(45,	78,	0,	'',	'secondRating'),
(44,	78,	0,	'efektívnejšie by si bolo požiadať až v ďalšom kole a tak mať aj omnoho detailnejší rozpočet',	'secondRating'),
(49,	78,	0,	'',	'secondRating'),
(41,	72,	0,	'V deliberaci se Vám podařilo objasnit mnohé nejasnosti, jsem rád, že se povedlo vyřešit i problém s nestudentem mezi žadateli ku spokojenosti žadatelů i komise.\r\nJediný možný rozpočtový problém vidím v nejasném počtu cestujících mezi Prahou a Brnem.\r\nPřeji si, ať se vám pro realizaci povede sehnat dostatečné množství účastníků-seniorů, aby měl celý záměr smysl.',	'secondRating'),
(42,	72,	0,	'Jsem rád, že jste žádost omezili na věci, o kterých jste si jisti, že se stanou.\r\nDo budoucna by bylo vhodné, kdyby účastníci měli na výjezdu markantnější spoluúčast - z pohledu jednotlivců se nejedná o nijak velké částky.\r\nDále vím, že je pro vás důležité podporování i účastníků z jiných fakult, k čemuž bych doporučoval získat nějaké finance například i ze stipendijního fondu FF-MU.',	'secondRating'),
(45,	72,	0,	'Oceňuji, že jste našli možnost snížení různých nákladů, kvituji zejména vyškrtnutí ne úplně vhodných odměn pro přednášející.',	'secondRating'),
(43,	72,	0,	'Precizně zpracovaná žádost, užitelná jako vzor pro všechny ostatní.\r\n',	'secondRating'),
(48,	72,	0,	'Nadále trvám na tom, že projekty, na kterých se vybírá vstupné by z důvodu vysoké volatility rozpočtu měly žádat až zpětně (slušná účast v minulém roce a velmi vysoký odhad na FB by Vám měly do takovéhoto kroku dodat jistotu). \r\nNicméně neberu to jako důvod pro zamezení podpoře, pouze snižuji v příslušných kritériích.\r\n\r\nOcenil bych, kdyby byl rozpočet exaktní a ne zaokrouhlený, chválím nicméně, že zaokrouhlujete směrem dolů.\r\n\r\nP.S.: děkuji za obrázek. Na oplátku taky jeden posílám: http://tinyurl.com/cnw4an5',	'secondRating'),
(49,	72,	0,	'Idea Vaší akce je dobrá (a myšlenka jejího převzetí do dalších oborů mě seriózně zaujala), s kvalitou projektu je to bohužel trochu horší.\r\n\r\nV první řadě musím říct, že váš výrok, že považujete za vhodné organizovat věci na poslední chvíli vám vůbec nepomáhá v kritériích, jakými jsou například důvěryhodnost, plán realizace odpovídající cílům a uskutečnitelnost.\r\n\r\nVáš přílohový rozpočet s deliberace je sice pěkný, ale pořád poměrně schématický. Snížení rozpočtu na méně než polovinu je třeba chápat jako nutný důsledek nedbalosti při sestavování rozpočtu.\r\nSami o sobě také tvrdíte, že chcete klást důraz na předkládání žádosti jako žádosti o podporu dvou akcí, v předložených dokumentech ale taková diferenciace není pro čtenáře uskutečnitelná.\r\n\r\nVítám Vaši snahu ušetřit za dopravu, k Vašim minulým zkušenostem můžu říct asi tolik: na akcích, placených ze skromného fondu skromné Fakulty Sociálních Studií považuji za krajně nevhodné proplácet PHM na cestu z Prahy do Brna a zpět či jiné šílenosti. Je tedy vhodné dát přednášejícím předem najevo, co jste a co nejste schopni ufinancovat.',	'secondRating'),
(48,	74,	0,	'Projekt plesu je pro mě problematický kvůli nejasnosti zisků z prodeje lístků. Je mi však jasné, že organizátoři potřebují zajistit uskutečnitelnost celé akce. Snižuji hodnocení v některých kategoriích, které pro mě ples není schopen dostatečně naplnit. Také nadále trvám na snížení v kategorii propagace, protože mě organizátoři na setkání nepřesvědčili o opaku. ',	'secondRating'),
(43,	74,	0,	'Výborný projekt se skvěle zpracovanou žádostí. Nemám připomínky. ',	'secondRating'),
(41,	74,	0,	'Skvěle připravený projekt. \r\nVelmi efektivní využití požadovaných peněz.  \r\nDobře zvládnutá obhajoba při setkání Komise s veřejností. ',	'secondRating'),
(47,	72,	0,	'Líbí se mi návrh snížení honorářů, ale i přes to si myslím, že za výjezd na exkurzi by organizátoři neměli být placeni neboť \"Všichni studenti participující na našich akcích mají možnost více se realizovat v oborech, které studují a které je baví.\"\r\n\r\nSamotná žádost byla velmi obecná, dodatečné dokumenty, které jsme obdrželi na deliberaci, naštěstí řeší konkrétní program jednotlivých akcí.\r\n\r\nP.S. ve zmiňovaných dokumentech máte drobnou chybu - exguvernérovi ČNB Tůmovi bych raději neříkal Vítězslave, jako spíš Zdeňku ;-)',	'secondRating'),
(46,	74,	0,	'Některé nedostatky projektu z žádosti byly napraveny během setkání s komisí. Nemám tak větších připomínek vůči tomuto projektu. ',	'secondRating'),
(47,	74,	0,	'Jsem rád, že se organizátoři rozhodli pro snížení odměn, na mé hodnocení to však nemá vliv. Nadále mám potíž s proplácením práce na událost, která se nekonala. ',	'secondRating'),
(49,	74,	0,	'Po úpravě rozpočtu nemám proti projektu negativní připomínky. Žádost se mi v nové podobě velmi líbí a dávám ji proto vysoké hodnocení ve všech kategoriích. Pro příště bych však doporučil žadatelům poctivější zpracování při úvodním podání žádosti a větší důraz na rozumnou práci s rozpočtem.',	'secondRating'),
(45,	74,	0,	'Pozitivně hodnotím rozhodnutí žadatele snížit rozpočet celé akce a také vydařený pokus o odpoštění nájmů za místnosti na fakultě. Zdá se mi však, že je v tomto kole několik projektů, které jsou lepší. A to i zpracováním žádosti. Pro příště bych doporučil podrobnější informace o smyslu celé akce, zaměření prezentací, odůvodnění rozpočtových položek, atd. ',	'secondRating'),
(44,	72,	0,	'Líbí se mi Váš nápad nahrazovat seminární výuku, která na fakultě téměř neexistuje. \r\nJiž realizovaná akce mi umožňuje vás posuzovat jako dostatečně důvěryhodné pro pořádání akcí dalších.\r\nDo budoucna by bylo vhodné zapracovat na kvalitě rozpočtu.',	'secondRating'),
(44,	74,	0,	'U tohoto projektu nemám důvod k výrazně odlišnému vnímání oproti prvnímu kolu hodnocení. Pozitivně reflektuji snížení rozpočtu o 3000 Kč.',	'secondRating'),
(42,	74,	0,	'',	'secondRating'),
(51,	77,	0,	'Jakým způsobem bude konference probíhat - jenom přednášky nebo praktické ukázky...?\r\n\r\nFinance: cattering za 5 000 Kč mi přijde hodně, i když v podsttě žádáte jonom o dva tisíce od fakulty. \r\n\r\nDále prosím o specifikaci - pomocné organizační síly a ostatní výdaje.',	'firstRating'),
(56,	77,	0,	'Dobrý projekt, nemám větších výhrad. ',	'firstRating'),
(52,	77,	0,	'Žádáte o hodně peněz. Není 6 000 kopií trochu moc?\r\nExistuje pořád i internetová verze brožury, co se zkusit zaměřit víc na ni?\r\nKolik stran bude mít brožura?\r\nJaký zájem byl o brožuru v loňském roce, rozdávalo se také 6 000 kopií?\r\n',	'firstRating'),
(53,	77,	0,	'Finance jsou naprosto přiměřené a ani celkově nemám výhrady. Dobrý projekt.',	'firstRating'),
(58,	77,	0,	'Definujte prosím časový rámec organizátorů, za který máte ve financích napočítáno 5 500 Kč. \r\nHonorář pro hosty 4 000 Kč, kolik hostů se bude účastnit a kdo jimi bude?',	'firstRating'),
(54,	77,	0,	'Rovnou k financím - když se jedná v podstatě o reprezentaci FSS, určitě by se dala vyjednat nějaké malá místnost zdarma na zkoušku. \r\nOsoby, které budou nacvičovat v Brně nemají šalinkartu?\r\n80 Kč na hodinu jako odměna mi přijde poměrně hodně. \r\nJakou plánujete kapacitu diváků?',	'firstRating'),
(55,	77,	0,	'Pronájem prostoru - nešla by cela usmlouvat? Jinak nemám dalších výtek.',	'firstRating'),
(57,	77,	0,	'Prosím o popis během obhajoby co všechno se bude v projektu s účastníky dělat a jakým způsobem je to bude rozvíjet. K financím výhrady nemám, jenom možná ohodnocení 70 Kč je vyšší než obvyklé. ',	'firstRating'),
(56,	76,	0,	'Sám jsem součástí projektu, nebudu ho proto hodnotit. Na druhou stranu vzhledem k tomu, že GP dostal peníze již v podzimním kole, preferoval bych spíše v zájmu diferzifikace a rozmanitosti protentokrát jiné projekty. ',	'firstRating'),
(51,	76,	0,	'Velký problém vidím v položkách, na které žádáte peníze: tento stipendijní fond je určen pro studenty FSS a peníze z něj by měly alespoň implicitně zůstat v \"rukou\" jejich studentů, zatímco v tomto případě jde většina peněz mezi externisty. Na druhou stranu díky financování z jiných zdrojů se dá na tento problém pohlížet jako na formalitu, jelikož účetně se rovněž dalo napsat, že peníze z jiných zdrojů půjdou na zaplacení výdajů externistů a zbytek bude placen z tohoto programu. V tuto chvíli tudíž nemám jasnou pozici v tom, jak se k rozpočtu Vašeho projektu stavím a prosím Vás tímto o jeho podrobné rozepsání a předložení na deliberaci, a to včetně položek, na než peníze nežádáte. S ostatními proměnnými (přínosnost, uskutečnitelnost...atd.) nemám problém.',	'firstRating'),
(52,	76,	0,	'Má hlavní otázka u tohoto projektu zní takto: proč by měl stipendijní fond FSS sponzorovat tisk brožury na jiných fakultách? Při naprosto reálně ceně 5 kč/brožura a 800 kusech distribuovaných na FSS tedy nevidím problém ve finanční podpoře 4000 Kč (všimněte si, že tato částka vůbec nepočítá se sponzorovaným tiskem), popřípadě o něco vyšší, aby si FSS \"zaplatila\" tisk brožury pro své účely kompletně ze svého, ale mám velké pochybnosti o tisku pro jiné fakulty. Tento bod bude tudíž mým hlavním dotazem při deliberaci. Samotný projekt totiž považuji za užitečný, reálný a účelný a tudíž vhodný podpory. ',	'firstRating'),
(53,	76,	0,	'Pokud by Lemur byl čistou záležitostí FSS, byla by tohle pro mě nejjednoznačnější žádost tohoto kola, s přiměřeným rozpočtem, vzorovou žádostí, skvělým projektem. Relativní problém je nicméně v tom, že Lemur NENÍ primárně projektem FSS a tudíž mohou nastat pochybnosti, zda toto je správný fond, ze kterého žádat. Proto bych na deliberaci rád slyšel obhajobu tohoto bodu.Osobně mám blíže spíše k tomu projekt podpořit (přeci jenom, na FSS se studuje žurnalistika a tohle je ideální forma stáže), nicméně konečné rozhodnutí v této oblasti si nechám do druhého kola.\r\nP.S.: Šéfredaktorka je formálně studentkou ESF ;)',	'firstRating'),
(58,	76,	0,	'Pěkný projekt s dobrou žádostí, pokud se vše vydaří tak, jak máte naplánováno, bude se dozajista jednat o úspěch. Tradičním problémem je rozpočet:\r\n1) Nájem místností FSS je ZDARMA. Pokud se jedná o nájem na jiných budovách, prosím o doložení nějaké formy \"dokladu\" o výše nájmu na těchto budovách, v opačném případě musí tato položka z rozpočtu pryč.\r\n2) Občerstvení: pro kolik lidí, jakou formou, na kolik akcí?\r\n3) Finanční odměnu jako takovou pro externisty nepodporuji. Pokud se má jednat o cestovné/občerstvení/ubytování, prosím o rozepsání, takovéto případy se rozhodnou per partes\r\n4) Zapůjčení vybavení z/na FSS je (pokud se nemýlím) rovněž zdarma. Pokud se jedná o vybavení mimo FSS, prosím o doklad, v opačném případě rovněž musí položka pryč.\r\n5) Prosím o podrobnější rozepsání (počet lidí, hodin..atp.)',	'firstRating'),
(54,	76,	1,	'Z mého pohledu poměrně diskutabilní a spíše slabý projekt s poměrně velkými nedostatky, které mě nutí ho v této chvíli nepodpořit, jelikož dle mého názoru nenaplňuje základní charakteristiky tohoto stipendijního programu.\r\nA) Jakým způsobem je koncert užitečný z hlediska některého z obecných cílů existence FSS, např. z hlediska psychologie?  \r\nB) Pokud na dané \"placce\" nebude propagována FSS, nevidím jediný důvod, proč rozdávat z peněz FSS dárky veřejnosti.\r\nC) Sporné nájemné za prostory, i když je možné, že na tyto účely vám skutečně FSS peníze zdarma nedá\r\nD) Malé zapojení studentů FSS, reálně možné podpořit pouze dva dané studenty, minulá studentka FSS ani ostatní účastníci peníze z tohoto programu dostat nemůžou\r\nE) Zpochybnitelná propagace FSS i možnost zapojení studentů FSS\r\nF) \"Plat\" 80Kč za hodinu při nácviku koncertu, tedy něčeho, co vás baví a děláte ve volném čase?! ',	'firstRating'),
(55,	76,	0,	'Důvěryhodný, odborně velmi přínosný projekt, který má mou plnou podporu a jehož jediným problémem je dle mého názoru položka \"pronájem místnosti na FSS\", jelikož pronájem místností na studijní účely na FSS je zdarma. Po snížení žádané částky o 3500 Kč má tedy tento projekt u mě jasnou zelenou.\r\n\r\nPro zvýšení bodového hodnocení doporučuji předložit podrobnější rozpis položek \"občerstvení\" a \"sborník na CD ROM\" (zejména kolik kusů) ',	'firstRating'),
(57,	76,	0,	'Efektně (a věřím že i efektivně) napsaná žádost na velmi zajímavý projekt, jehož prezentaci si rád na živo vyslechnu na deliberaci. Poměrně vysoká je odměna 5600 Kč pro jednoho jedince...není neobhajitelná, ale vyžaduje argumentaci na vyšší úrovni než \"odeslal jsem 120 mailů a vytiskl 100 papírů\". Proto mé otázky na deliberaci budou zaměřeny na bližší poznání projektu, který mne skutečně zaujal, a právě na velikost osobní odměny. Obecně ale nevidím větší problém a projekt podporuji, ALE je třeba do deliberace (nejpozději na ní) doložit garanci! V opačném případě bohužel projekt podpořen nebude. ',	'firstRating'),
(51,	72,	0,	'V rozpočtu se mi nezdají 4000Kč na pomocné organizační síly, můžete specifikovat, kolik lidí budete na jaké práce najímat a jaká bude jejich mzda? \r\nMůžete dále specifikovat cestovní náklady, tj. odkud předpokládáte příjezd daných hostů. Jak vyšly v uváděných položkách rozpočty minulých let? Jinak chválím dobře zpracovaný návrh.\r\n',	'firstRating'),
(56,	72,	0,	'Rád bych Vám dal více bodů v některých kategoriích (efektivita), uvítal bych Však určitou podrobnost v odměňování - abychom před schválením stipendia věděli, kdo z redaktorů napracoval kolik hodin, a jaká odměna mu za to náleží.\r\nZvlášť, když je celá požadovaná částka tvořena právě odměnami.',	'firstRating'),
(52,	72,	0,	'Můžete mi prosím nastínit, jakým způsobem jste vypočetli uváděné náklady? Mám tím na mysli zejména Tisk (kde, za kolik, v jaké kvalitě, v jakém množství) a distribuci.',	'firstRating'),
(53,	72,	0,	'Děkuji za velmi kvalitně zpracovanou žádost. \r\n',	'firstRating'),
(58,	72,	0,	'K Vašemu projektu mám několik dotazů; 1) Komu budete platit za kolik hodin práce jakou hodinovou mzdu? 2) Jaké prostory si hodláte najímat? 3) Jak máte ošetřena autorská práva k filmům (nebude-li projekce na fakultě)?\r\n',	'firstRating'),
(54,	72,	0,	'Opět nemám úplně jasno ve způsobu získání uváděných částek. Kolik chcete za uvedenou částku vytisknout letáků? Kolik vyrobit placek? \r\nMusím říct, že nemám příliš velkou důvěru v prezentaci fakulty v ostatních městech touto formou, mám dojem, že spojitost s činností FSS končí právě faktem, že se na projektu podílí studenti. Jaká je Vaše vize? Co FSS přinese propagace v daných lokalitách? Kolik diváků obvykle chodí na vystoupení kapely?\r\n',	'firstRating'),
(55,	72,	0,	'Žil jsem v domnění, že za pronájem místností se na aktivity tohoto rázu fakultě již neplatí, jste si jisti, že vy musíte?\r\n',	'firstRating'),
(57,	72,	0,	'Musím říct, že s takto originální a kvalitní žádostí jsem se během praxe v Komisi ještě nesetkal, nemám co dodat.\r\n',	'firstRating'),
(51,	74,	0,	'Projekt se mi velmi líbí. Pozitivně hodnotím nejen obsahovou stránku žádosti, ale také její zpracování. Jako plus vnímám také fakt, že žadatelé byli schopni získat finance i z dalších zdrojů. \r\n\r\nMám však potíže s některými položkami v rozpočtu. Například bych byl rád, když by bylo specifikováno, co znamená „vytvoření a zpracování audiovizuálního záznamu konference“, když techniku dostanete zapůjčenou zdarma. Co jsou 4000 Kč na pomocné síly? O koho se jedná? Proč dostává zaplaceno? Je catering za 5000 Kč skutečně nezbytný? Nedala by se tato položka nějak rozumně snížit? ',	'firstRating'),
(56,	74,	0,	'Tradiční projekt, který je nenahraditelnou součástí fakulty. Časopis jsme podpořili již v loňském roce. Nemám významnější negativní připomínky. ',	'firstRating'),
(52,	74,	0,	'Projekt považuji za dobrý. Stejně tak zpracování žádosti. Domnívám se, že činnost, které se projekt věnuje, je velmi prospěšná a pro studenty důležitá. Velmi pozitivně hodnotím to, že žadatelé jsou schopni většinu financí získat ze soukromých zdrojů pomocí prodeje inzerce. \r\n\r\nProjekt je však určen i pro ostatní studenty MU. Dle tiráže předloženého staršího vydání byl projekt v minulosti podpořen programem rektora MU. Zajímalo by mě, zda i pro realizaci plánovaného vydání byl osloven rektorát MU, nebo některá z ostatních fakult Masarykovy univerzity. ',	'firstRating'),
(53,	74,	0,	'LeMUr.mu považuji za dobrý projekt, který je na celé MU dobře známý. K samotnému projektu tedy nemám žádné připomínky.\r\n\r\nMám však k žádosti následující otázky a připomínky:\r\n\r\n- Byl bych rád, když by více byla obhájena potřeba nové webové šablony. Samozřejmě by mě také zajímalo důslednější obhájení cený této šablony (ne pouze vyjýdření, že se jedná o cenu obvyklou). Bohužel jsem kvůli nespokojenosti s popisem této položky musel snížit hodnocení v některých kategoriích. \r\n\r\n- Zajímalo by mě, zda by bylo možné, aby na serveru byla, v případě udělení stipendia, podpora FSS výslovně uvedena. Myslím, že by to významně pomohlo vhodnocení propagace FSS projektem.  \r\n ',	'firstRating'),
(58,	74,	0,	'Žádost mě obsahově skutečně zaujala. Myslím si, že se jedná o výborné dopnění standartní výuky na FSS. \r\n\r\nMusel jsem bohužel výrazně snížit hodnocení ve finančních kategoriích. Považuji obhájení rozpočtu za velmi slabé. Vedou mě k tomu následující důvody:\r\n- S jakými prostory na pronájem se počítá? Proč stojí tolik, kolik je uvedeno v žádosti?  \r\n- Jaké vybavení bude zapůjčeno, proč a z čeho vychází předkládaná cena?\r\n- Z jaké propočtu vychází honorář pro organizátory?\r\n\r\nV žádosti také nejsou uvedeny doplňující informace (učo atd.) o dalších žadatelích. To je ale jen maličkost. \r\n\r\nDomnívám se, že všechny výše zmíněné výhrady bude možné napravit během setkání žadatelů s komisí. ',	'firstRating'),
(54,	74,	0,	'Zajímavý projekt, který se celkem vymyká charakteru ostatních žádostí, se kterými se setkáváme. Musím ale říct, že mi žádost přišla místy zmatená. Je tak možné, že jsem ne vše uplně pochopil. Například vůbec netuším, jakou očekáváte návštěvnost na akcích\r\n\r\nAsi jedinou větší připomínku mám ohledně rozpočtu. Zaprvé bych se rád zeptal, zda by nebylo možné, aby účinkující zkoušeli ve spolkovně FSS, kam by měli přístup zdarma (odpadla by tak vysoká částka za nájem). Případně, zda by nebylo možné vyjednat jinou místnost na FSS zdarma. Dále bych se rád zeptal, v jak velkém množství plánují žadatelé tisk letáků a placek. I u letáků se jedná o poměrně vysokou částku, která je požadovaná, ale především u placek je 4 000 Kč skutečně hodně. Rád bych proto věděl, jaké množství placek chtějí žadatelé vytvořit. \r\n\r\n',	'firstRating'),
(55,	74,	0,	'Tradiční konference, jejíž přínos je pro mne nesporný. Mám jen dotaz, zda by nebylo možné zařídit využití místnosti na FSS zdarma. Jsem přesvědčen, že pro akci, která má formální podporu uvnitř FSS, musí být cesta pro bezplatné propůjčení místnosti. Jelikož považuji tento náklad jako zbytečný, tak snižuji hodnocení v kategorii „efektivita“.',	'firstRating'),
(57,	74,	0,	'K žádosti nemám žádné výrazné negativní připomínky. ',	'firstRating'),
(51,	74,	0,	'Pozitivně hodnotím obhajobu projektu při setkání žadatelů s komisí. Hodně mých nejasností se vyjasnilo. Budu rád, když bude projekt podpořen. ',	'secondRating'),
(56,	74,	0,	'I v prvním kole jsem projekt hodnotil nadprůměrně. Považuji aktivity GP za velmi přínosné pro studenty i širší akademickou sféru. Souhlasím však s názorem, že podporovány by neměly být pouze odměny pro organizátory, ale spíše nutné náklady na chod projektu. Z tohoto důvodu snižuji hodnocení v kategorii „efektivita“.  ',	'secondRating'),
(52,	74,	0,	'Nápad brožury se mi líbí. Myslím, že je prospěšná. Musím však snížit hodnocení za to, že žadatelé chtějí financovat tisk brožury pro celou univerzitu pouze ze stipendijního fondu FSS a nezapojují tak finančně i jiné fakulty, nebo přímu MU. Nemyslím si, že je to správné a efektivní využití finančních zdrojů stipendijního fondu. ',	'secondRating'),
(53,	74,	0,	'Nemám nějaký hlubší komentář. Projekt se mi líbí a myslím, že prezentace na setkání s komisí mě spíše utvrdila v názoru, že je dobré existenci internetového serveru Lemur.mu podpořit. ',	'secondRating'),
(58,	74,	0,	'Především je třeba říct, že si vážím snížení rozpočtu, které vychází z rozmyšlení si některých konkrétních nákladů. Na setkání s komisí také byly mnohem podrobněji vysvětleny některé části rozpočtu. V nové podobě je rozhodně, myslím si, projekt vhodný k podpoře. ',	'secondRating'),
(54,	74,	1,	'Žadatelé se bohužel vůbec nedostavili na setkání s komisí a ani se nepokusili komisi kontaktovat jiným způsobem. Z tohoto důvodu jsou zachovány mé pochybnosti, které jsem měl při čtení předložené žádosti. Nepřítomnost na setkání také znamená snížení u některých kategorií. \r\n\r\nPředevším však nevyjasnění některých otázek, které komise k projektu měla, znamená, že nemám dostatek informací, abych mohl zodpovědně tuto žádost podpořit. Z tohoto důvodu jsem se rozhodl projekt ohodnotit jako nevhodný k podpoře. ',	'secondRating'),
(55,	74,	0,	'Po snížení původní částky a vyjasnění některých nejasností v projektu si myslím, že se jedná o kvalitní žádost, která je rozhodně vhodná k podpoře. ',	'secondRating'),
(57,	74,	0,	'Moc mě mrzí, že žadatel se nedotavil na setkání s komisí. Přesto si myslím, že se jedná o výjimečně kvalitně zpracovanou žádost, která by určitě měla být podpořena. Musím však na základě nepřítomnosti snížit hodnocení v některých kategoriích. ',	'secondRating'),
(51,	76,	0,	'Oceňuji snížení rozpočtu, konstruktivní přístup a snahu podrobně vysvětlit položky rozpočtu. Nemám dalších výhrad.',	'secondRating'),
(56,	76,	0,	'Jakožto účastník projektu nebudu hodnotit ani v druhém kole.',	'secondRating'),
(52,	76,	0,	'Jelikož stále nejsem přesvědčen o správnosti tisku brožury pro celou univerzitu z peněz FSS a jelikož žadatelé nepřistoupili na snížení částky (což je jejich plné právo) snižuji hodnocení v příslušných kategoriích. ',	'secondRating'),
(53,	76,	0,	'Kvalitně připravená argumentace na deliberaci, nemám dalších výhrad. ',	'secondRating'),
(58,	76,	0,	'Velmi oceňuji razantní snížení rozpočtu a konstruktivní přístup. Za mě jednoznačné pozitivum. ',	'secondRating'),
(54,	76,	1,	'Jelikož žadatelé nedorazili na deliberaci, nemám důvod měnit své rozhodnutí. Projekt proto ani v tomto kole nepodpořím. ',	'secondRating'),
(55,	76,	0,	'Velmi dobrý projekt, bez dalších výhrad. ',	'secondRating'),
(57,	76,	0,	'Mrzí mě, že žadatel nedorazil na deliberaci. Ač v prvním kole nejlepší projekt, přeci jen zde bylo několik nejasností, které se měly vyjasnit. Proto podpora ANO, nicméně z jasné se změnila spíše na vlažnou :) ',	'secondRating'),
(51,	77,	0,	'všechny nejasnosti zodpovězeny na schůzi',	'secondRating'),
(56,	77,	0,	'nemám dalších poznámek, skvělý projekt, do kterého dáváte spoustu vašeho času',	'secondRating'),
(52,	77,	0,	'I když je celá redakce složená převážně ze studentů FSS? velká většina brožur se rozdá mimo fakultu. \r\nŽádáte o hodně peněz, i když na druhou stranu vypublikujete velké množství brožur.',	'secondRating'),
(53,	77,	0,	'dobrý projekt, ke kterém nemám víc výhrad.',	'secondRating'),
(58,	77,	0,	'bez připomínek, dobrý projekt',	'secondRating'),
(54,	77,	0,	'nezodpovězeny otázky z prvního kola hodnocení.',	'secondRating'),
(55,	77,	0,	'nemám dalších připomínek, dobrý projekt',	'secondRating'),
(57,	77,	1,	'',	'secondRating'),
(57,	72,	1,	'Vzhledem ke stažení žádosti dávám jako nevhodné podpoře.\r\nJe škoda, že takto dobrý projekt nebude realizován, doufám, že se Vám povede se k němu někdy v budoucnu vrátit.',	'secondRating'),
(54,	72,	1,	'Vzhledem k neúčasti na deliberaci a tudíž nezodpovězení Našich, mnohdy fundamentálních, otázek k projektu, hodnotím jako nevhodné k podpoře.',	'secondRating'),
(52,	72,	0,	'Stále vidím určitý problém v podpoře tisku brožury, jejíchž 8/9 poputuje mimo FSS, snižuji tedy hodnocení v návazných kategoriích.',	'secondRating'),
(58,	72,	0,	'Odpovědi na otázky z prvního kola byly vyčerpávající a přínosné pro hodnocení projektu z mojí strany.\r\nZároveň kvituji velmi obšírné vysvětlení struktury výdajů.',	'secondRating'),
(53,	72,	0,	'Vaše vystoupení při deliberaci bylo velmi kvalitní, nemám nejmenší pochyby o vhodnosti podpory Vašeho projektu.',	'secondRating'),
(55,	72,	0,	'Velmi kvalitní projekt. Přeji Vám, ať se konference vydaří.',	'secondRating'),
(56,	72,	0,	'',	'secondRating'),
(51,	72,	0,	'Vaše vystoupení mi dostatečným způsobem objasnilo veškeré výhrady. Vaše argumenty ohledně výdajů projektu jsou racionální.',	'secondRating'),
(64,	76,	0,	'Přínosný projekt, který bych jako začínající student určitě ocenil. Nicméně nemyslím si, že je správné, aby celý projekt byl hrazen ze stipendia, čistě subjektivně si myslím, že 50% spoluúčast účastníků je naprosto v pořádku. Z tohoto důvodu bych mnohem více ocenil, kdyby žádaná částka nepřevýšila 11 000 Kč.Vzhledem k tomu, že za nejvíce \"nadbytečnou\" považuji položku \"strava\", po jejím potencionálním odstranění se k oné částce téměř blížíme.  \r\nRovněž budu na deliberaci požadovat vysvětlení položek \"organizační logistika\" a odůvodnění toho, proč jsou pozvánky posílány poštou a ne standardně e-mailem. \r\n\r\nNa druhou stranu zde vidím velký potenciál pro růst hodnocení ve druhém kole. Je jen na vás, jak se šance zhostíte ;)',	'firstRating'),
(65,	76,	0,	'Z formálního hlediska je vaše žádost v pořádku, rovněž žádaná částka za redaktora je relativně v mezích. Nicméně vzhledem k tomu, že Halas tento školní rok již peníze dostal, není má podpora tohoto projektu v rámci tohoto kola nijak horlivá.\r\n\r\nRovněž by mě na deliberaci zajímalo, jaká je nynější ekonomická situace Halasu, jelikož zde přeci jen mohou vystávat otázky, zda těmito naoko odměnami opět nesanujeme špatný ekonomický model časopisu.\r\n\r\nRelativně na pováženou je vaše nedbalost v plnění formálních povinností (garance, závěrečná zpráva...)',	'firstRating'),
(60,	76,	0,	'Jediným mírným negativem je u mne fakt, že SSIIPS již tento školní rok o peníze žádala. Jinak bez připomínek. ',	'firstRating'),
(63,	76,	0,	'Pěkný projekt, střízlivý rozpočet, dobrá žádost. Nemám připomínek.',	'firstRating'),
(59,	76,	1,	'Tato žádost je bohužel \"dobrým\" příkladem toho, jak by neměla vypadat. Potenciálně velmi dobrý projekt s bezproblémovým rozpočtem je totálně ubit absolutním nedostatkem informací. Ze žádosti jsem se bohužel nedozvěděl vůbec nic, tedy co je vlastně projekt zač, jak bude probíhat, pro kolik lidí bude, co si z něj odnesou, jakou práci vykonají žadatelky a v jakém rozsahu...atd.\r\n\r\nZ principu v tomto kole nedoporučuji projekt k podpoře, jelikož takovéto žádosti dle mého názoru není možné akceptovat. \r\n\r\nPřipravte si prosím kvalitní výstup na deliberaci, pokud si projekt dobře obhájíte, \"nedoporučeno\" ode mě z největší pravděpodobností zmizí a hodnocení půjde nahoru. ',	'firstRating'),
(66,	76,	0,	'Chápu to správně, že žádáte 4000 Kč odměny za napsání 10 článků, tj. 20 normostran? Nemůžu si pomoct, ale odměna 200 Kč za normostranu mi přijde jako více než přemrštěná suma...jako akceptovatelnou částku vidím cca 1000 Kč, 1500 Kč při velmi dobrém odůvodnění.\r\n\r\nNavíc na tento projekt (byť na jiný účel) jste žádala již v minulém grantovém kole, což u mě rovněž snižuje hodnocení. \r\n\r\nRovněž mi příjde velmi sporné, aby si jednotlivec žádal odměnu sám pro sebe. Není to vyloženě proti pravidlům, ale vzhledem k omezení kontrolních prostředků, která taková žádost v sobě implicitně nese, tomuto nejsem příliš nakloněn. \r\n\r\nBude velmi záležet na deliberaci a dobrém vysvětlení, zatím ale nevylučuji možnost, že váš projekt ve druhém kole z výše zmíněných důvodů nepodpořím.',	'firstRating'),
(61,	76,	0,	'Sekuriťáci patří k zaběhnutým a přínosným projektům, kteří si podporu určitě zaslouží. Velmi se mi líbí originální způsob odměňování. Nicméně: Podle jakého systému budou poukazy rozdávány? Jaké je aktuální složení redakce? Jsou všichni členové redakce studenti FSS? \r\n',	'firstRating'),
(62,	76,	0,	'Oceňuji, že se letos má konat již druhý ročník projektu, který určitě není nikterak lehké zorganizovat. Projekt pěkný, vyčíslení nákladů rozumné, prosím o vysvětlení položky \"pravidelná administrace webu\" : kdo to dělá, kolik práce ho to stojí...s tou jedinou mám trochu problém...',	'firstRating'),
(67,	76,	1,	'Samotný projekt je perfektní, ale 19 000 Kč za odměny na brožuru o 32 stránkách? Abstraktní položky typu \"vedení týmu\"? 200 Kč za normostranu textu?\r\n\r\nKdo koho vede? Kolik hodin celá práce zabere? Mezi kolik lidí se finance dělí? \r\n\r\nNavíc se ke mě doneslo info, že samotný projekt je díky inzerci ziskový a zisk se dělí právě mezi samotné redaktory/lidi, kteří se na projektu podíleli. Můžete se k tomuto vyjádřit?\r\n\r\nZ mého pohledu naprosto nedůvěryhodná žádost, která dle mého názoru uměle dělí tu samou věc, tj. peníze na odměny do rukou JEDINÉHO žadatele, na několik formálních položek. \r\n\r\nŽádost hodnotím jako nevhodnou k podpoře, jelikož po přečtení žádosti v ní bohužel nemám ani kapku důvěry. Nemůžu se totiž zbavit dojmu, že tato žádost má jediný cíl: několika žadatelům finančně vypomoci s prázdninovými cestami. ',	'firstRating'),
(64,	79,	0,	'Z mého pohledu jde primárně o seznamovací akci, reálný edukační přínos nevidím a taky se nijakým způsobem nezviditelní fakulta u širší veřejnosti. Vzhledem na výše zmíněné se tedy ptám, proč by měla fakulta platit all inclusive party pro 30 lidí? Nešlo by stipendiu snížit jenom na nutné náklady pro organizátory, kterých čas, nasazení a námahu si samozřejmě vysoce ceníme?',	'firstRating'),
(65,	79,	0,	'',	'firstRating'),
(60,	79,	0,	'',	'firstRating'),
(63,	79,	0,	'',	'firstRating'),
(59,	79,	0,	'',	'firstRating'),
(61,	79,	0,	'',	'firstRating'),
(65,	81,	0,	'Bezesporu skvělí projekt, jehož tvůrci zasluhují žádané ocenění. Pokud však stipendium pro tento projekt bude stát v cestě uskutečnění jiného projektu, který žádá o finance na technické uskutečnění a nejen na odměny, upřednostním ten. ',	'firstRating'),
(63,	81,	0,	'nehodnotím z důvodu spolupráce na konferenci',	'firstRating'),
(60,	81,	0,	'nehodnotím vzhledem k mému členství ve Studentské sekci IIPS',	'firstRating'),
(59,	81,	1,	'Zajímavý projekt i dobře napsaná žádost, je však škoda, že kurz nijak neumožňuje účast studentům FSS (kromě dvou v organizačním týmu). Nebylo by možné, vzhledem k cílení kurzu výhradně na zaměstnance magistrátu města Brna, najít jiný způsob jeho financováni, než je Stipendijní program na podporu kulturní a spolkové činnosti FSS? ',	'firstRating'),
(66,	81,	1,	'Jak přispívá projekt k prezentaci FSS? Jakým přínosem je pro studenty FSS, jak je provázán s výukou na FSS? Pokud jde v podstatě o žádost na odměny pro jednoho člověka v projektu, který je dlouho zaběhnutý, bylo by možná dobré zvážit, zdali by nebylo vhodnější žádat o stipendium jinde. Tento projekt má dle mého názoru mnohem širší pole působnosti a s FSS a její spolkovou či kulturní činností nijak přímo nesouvisí. Otázky na deliberaci budu tedy směřovat primárně tímto směrem, jsem totiž přesvědčen, že toto stipendium má sloužit primárně jako nástroj umožňující realizaci projektů studentů v rámci FSS a o tomto zaměření projektu mě žádost samotná příliš nepřesvědčila. Sem ovšem pochopitelně ochoten na základě průběhu deliberace tento postoj změnit.',	'firstRating'),
(67,	81,	0,	'Jedná se o dobře napsanou žádost a bezesporu přínosný projekt, který dle mého názoru navíc svým zaměřením přesně naplňuje podstatu tohoto typu stipendia. Avšak vzhledem k výši požadované částky bych uvítal podrobněji rozpracovaný rozpočet a ochotu jej diskutovat a případně snížit částky jednotlivých položek jak jen to bude možné, neboť požadovaná částka tvoří více jak třetinu objemu financí rozdělovaných v tomto stipendijním kole, a její schválení s předkládaným rozpočtem by tedy znamenalo značné omezení podpory jiných dobrých projektů.',	'firstRating'),
(66,	79,	0,	'',	'firstRating'),
(67,	79,	0,	'Podle mého názoru, se žádosti tohoto typu hodí spíše jako žádosti o celouniverzitní stipendium. V případě podpory navrhuju snížení stipendia o náklady na tvorbu celouniverzitní části. Žadatelky se taky chci zeptat, na co přesně půjde částka za Vedení fakultního týmu, a když se jedná o odměnu, tak kolik lidí za jakou odpracovanou dobu ji dostane. ',	'firstRating'),
(62,	79,	0,	'Ako člen organizačného tímu muniMUN, ho nebudem hodnotiť. Michaela Šedovičová.',	'firstRating'),
(64,	81,	0,	'Samozřejmě velmi přínosný a užitečný projekt. V porovnáni s ostatními žádostmi i celkovým objemem financí rozdělovaných komisí v tomto kole je však požadovaná částka opravdu velmi vysoká. Podpora tohoto projektu za těchto podmínek by proto znamenala nemožnost podpořit vyšší počet jiných dobrých žádostí. Otázky na deliberaci budu proto směřovat na detailní rozbor rozpočtu a věřím že jej bude možné snížit. Je opravdu nezbytné rozesílat pozvánku poštou ? Jaký je odhadovaný počet účastníků, nebo na základě čeho vznikla kalkulace uváděných nákladů ? Je pro uskutečnění projektu opravdu nezbytné hradit účastníkům veškeré náklady spojené s akcí ?',	'firstRating'),
(61,	81,	0,	'',	'firstRating'),
(62,	81,	0,	'',	'firstRating'),
(64,	72,	0,	'Na bootcampu jsem při nástupu do studia sám byl a myslím si, že si zaslouží podporu. Posílám dvě otázky k zodpovězení na setkání.\r\n\r\n1) Rozumím tomu správně, že chcete posílat pozvánky poštou? Když jsem byl v prvním ročníku, přišla mi informace e-mailem, což za situace, kdy jsou studenti během prázdnin rozmístěni různě po světě, považuji za nejlepší způsob...\r\n2) V tomto nastavení počítáte s tím, že účastníci nebudou platit vůbec žádný poplatek? Myslím si, že u zážitkové akce by byla vhodná určitá spoluúčast, která vám pomůže s výběrem účastníků (na akci zadarmo se vám klidně může přihlásit 80% ročníku) a přiměje je si více vážit toho, co jste připravili',	'firstRating'),
(65,	72,	0,	'Opomeneme-li problém s garancí, je třeba ještě zmínit, že Vaše žádost jen velmi minimálně reflektuje to, co máme podpořit (práci čtyř konkrétních lidí) a mluví spíše o Halasu jako celku.\r\nChtěl bych se zeptat, proč se opět střídáte v podávání žádostí a komunikaci tak nezajišťuje Váš fundraiser?',	'firstRating'),
(66,	72,	0,	'1) V současném nastavení (kdy projekt je fakticky něčím, co Vás baví a fakulta má značně omezené zdroje na podobné aktivity) mi 200Kč za normostranu příjde jako velmi nadsazená cena, dovedete přemýšlet o změně sazby?\r\n2) Vydává články ještě někdo jiný? V žádosti se sice píše o dalších lidech, nicméně vzhledem k plánu v poli G mám dojem, že žádáte o peníze jen na svou vlastní tvorbu.',	'firstRating'),
(62,	72,	0,	'Projekt je dobře popsaný a jeho rozpočet je reálný, doporučuji k podpoře.',	'firstRating'),
(67,	72,	0,	'1) Jaká vazba je momentálně mezi Vaší redakcí a fakultou? Měl jsem dojem, že Prvákoviny se již staly integrální částí fakulty, zkoušeli jste se vedení ptát na přímé financování? \r\n2) 200Kč za stranu je i v tomto projektu hodně\r\n3) Kdo si u Vás koupil za 23 tisíc inzerci?\r\n4) Jak budou peníze rozděleny? Jsou peníze za činnost opět určeny jen A.Beranové, nebo je zde více příjemců?\r\n5) Kdo financuje produkci celouniverzitního vydání?',	'firstRating'),
(61,	72,	0,	'',	'firstRating'),
(65,	80,	0,	'',	'firstRating'),
(60,	80,	0,	'',	'firstRating'),
(63,	80,	0,	'projekty jsou všechny zpracovány kvalitně, odborný a kulturní přínos nepopiratelný.',	'firstRating'),
(67,	80,	0,	'Oproti jiným projektům se mi jeví mzdové nároky vyšší než ostatní projekty, ale jsem ochotna projekt podpořit.',	'firstRating'),
(59,	80,	0,	'Uvítala bych zaměření kurzu na studenty FSS, na magistrátě si mohou tisk zaplatit sami, popř. získat tuto sumu z rozpočtu Magistrátu.',	'firstRating'),
(66,	80,	0,	'Výborný projekt, který motivuje k větší kativitě při vyhledávání stáží a uvádí příklady dobré praxe.',	'firstRating'),
(62,	80,	0,	'Projekt, který jednoznačně podporuje iniciativu jak přípravného týmu, tak účastníků.',	'firstRating'),
(64,	80,	0,	'Uvítala bych drobnější omezení rozpočtu, ve prospěch ostatních žádostí.',	'firstRating'),
(61,	80,	0,	'Doporučuji.',	'firstRating'),
(59,	72,	1,	'Nápad na uskutečnění projektu je dobrý, nicméně zpracování žádosti je velmi stručné a postrádající některé informace, které by se nám mohly hodit v posuzování a Vám by přinesly další body, například;\r\n\r\n1) Máte nějaké zkušenosti s pořádáním takových akcí?\r\n2) Účastníky kurzu jste si již sehnali, či se zatím bavíme v konceptuální rovině?\r\n3) Můžete alespoň rámcově nastínit, jak bude samotný kurz probíhat?\r\n\r\nVzhledem k tomu, že vedení fakulty stanovilo povinnost garanta být zaměstnancem, označuji projekt v tuto chvíli za nevhodný k podpoření. Dodáte-li garanci od některého ze zaměstnanců FSS, důvody pro blokování Vaší žádosti z mé strany pominou.\r\nOmlouvám se za nejednoznačný výklad směrnice, do budoucna se zasadíme o to, aby bylo všem jasné, kdo může a kdo nemůže být garantem projektu.',	'firstRating'),
(60,	72,	0,	'Děkuji za velmi kvalitní závěrečnou zprávu a nyní i další žádost.',	'firstRating'),
(63,	72,	0,	'Vaše žádost je velmi kvalitní.',	'firstRating'),
(60,	80,	0,	'Předkládané aktivity Studentské sekce IIPS: přednáška J. Rupnika i zaplacení traileru Filmového klubu je řádně odůvodněna a nese přidanou hodnotu pro naplnění cílů programu..',	'secondRating'),
(63,	80,	0,	'Projekt Studentské antropologické konference je naplněním cílů tohoto stipendijního programu, rozvíjí odborné i občanské dovednosti a je jednoznačně zaměřen na studenty FSS MU. ',	'secondRating'),
(65,	80,	0,	'Projekt časopisu Halas je projektem zaměřujícím se na studenty FSS MU, rozvíjí  praktické dovednosti i občanské dovednosti.',	'secondRating'),
(62,	80,	0,	'Projekt – muniMUN 2013 navazuje na předchozí projekty a podporuje odborné i občanské dovednosti. Propaguje FSS a umožňuje kultivovat jak umění debatovat, tak tříbit si vlastní názory.',	'secondRating'),
(61,	80,	0,	'Projekt – Sekuritaci.cz - studentský portál (ne)jen o bezpečnosti podporuje profesní i občanské dovednosti, umožňuje tříbit si názory o současné bezpečností situaci, je propagací FSS a svým zaměřením dokonce přesahuje zaměření na studenty FSS MU.',	'secondRating'),
(59,	80,	0,	'Projekt – Kurz týmové spolupráce jistě přinese studujícím cenné zkušenosti apotřebnou sebedůvěru pro další studium i motivaci k pokračování v cestě lektora. Propaguje FSS MU.',	'secondRating'),
(66,	80,	0,	'Projekt – Jdi pracovat! (články na internetových stránkách www.jdipracovat.cz) přibližuje studujícím realitu projektů života i profese a pomáhá jim zorientovat se na trhu práce a kultivovat odborné i občanské dovednosti. Prezentuje také FSS MU.',	'secondRating'),
(64,	80,	0,	'Projekt – BSS Bootcamp navazuje na předchozí ročníky seznamovacích víkendů a jednoznačně přispívá k dobré studijní atmosféře i rozvoji odborných i občanských dovedností studujících. Projekt prezentuje FSS MU.',	'secondRating'),
(67,	80,	0,	'Zaměření na studující 1. ročníku je dobrou investicí univerzity, pomáhá jim dát najevo, že neosobní instituce není tak neosobní, že je možné se na koho obrátit, umožňuje se zorientovat v prvních týdnech po někdy prvním opuštění domova. Rozvíjí odborné dovednosti i občanské ctnosti. Bylo by dobré reflektovat vyšší efektivitu projektu a přesvědčivost pro členy komise.',	'secondRating'),
(60,	81,	0,	'Nehodnotím vzhledem k mé účasti na projektu.',	'secondRating'),
(63,	81,	0,	'Nehodnotím vzhledem k mé účasti na projektu.',	'secondRating'),
(64,	79,	0,	'Tento projekt bol pre mňa osobne problémový, ale od deliberácie mám pocit, že to bolo iba z dôvodu nedostatku skúseností s týmto tipom žiadostí. Teraz ho rada odporučím.',	'secondRating'),
(60,	79,	0,	'',	'secondRating'),
(67,	79,	1,	'Projekt na mňa nepôsobí dôveryhodne a po diskusii na deliberácii som nadobudla dojem, že celý projekt Prvákovin neefektívne hospodári s prostriedkami. V prípade záujmu o podporu v budúcom kole odporúčam prehodnotiť výšku odmien a hlavne podrobne rozpísať rozpočet.',	'secondRating'),
(63,	79,	0,	'Bezproblémový projekt.',	'secondRating'),
(61,	79,	0,	'Oceňujem formu odmien. Mohla by byť inšpiráciou niektorým ostatným žiadateľom.',	'secondRating'),
(65,	79,	0,	'',	'secondRating'),
(66,	79,	1,	'Projekt neodporúčam podporiť z niekoľkých dôvodov. Jedným je neprehľadné napísanie žiadosti, ktoré aj napriek vyhláseniu na deliberácii, stále hovorí iba o jednej prijímateľke štipendia, teda sa stráca kontrola nad zverenými peniazmi. Ak by aj žiadateliek bolo viacero, jedna v súčasnej dobe podľa slov žiadateľky (ešte?) nie je študentkou FSS ani MU. Druhý problém je, že na tento projekt v tomto roku už boli dané peniaze z rovnakého štipendia a tretí, snáď najväčší problém je, že Jdi pracovat! nie je organizované súčastnými študentmi FSS a nie je ani primárne zamerané an FSS (MU), zaujíma sa všeobecne o absolventov VŠ. ',	'secondRating'),
(62,	79,	0,	'Opäť sa nezúčastňujem hodnotenia.',	'secondRating'),
(59,	79,	0,	'Teší ma úspešné zorganizovanie projektu a aj jeho zdarný koniec. Rada by som do budúcnosti žiadateľkám odporúčala viac popracovať na žiadosti.',	'secondRating'),
(62,	81,	0,	'',	'secondRating'),
(61,	81,	0,	'Oceňuji především kreativní způsob rozdělování odměn.Přínos projektu samotného je pro mě evidentní a jeho rozpočet střídmý.',	'secondRating'),
(65,	81,	0,	'',	'secondRating'),
(66,	81,	0,	'Vhledem k slibu rozdělit finance na odměny mezi více členů redakce (což původní žádost neuváděla) a snížení původní požadované částky, jsem se rozhodl projekt nakonec podpořit.',	'secondRating'),
(59,	81,	0,	'Po vyjasnění a specifikaci povahy projektu, která v původní žádosti nebyla zcela srozumitelná, sem se rozhodl projektu vyjádřit podporu.',	'secondRating'),
(64,	81,	0,	'I po snížení mi požadovaná částka přijde jako velmi vysoká vzhledem k povaze akce i ke způsobům jakými byla financována v minulých letech. I přes to je ale po snížení rozpočet mnohem střízlivější a nemám s ním už takový problém. Snad se finanční podpora ze stipendia podepíše na celkové kvalitě akce, která je sama o sobě bezesporu přínosná a svou povahou naplňuje podstatu projektu vhodného podpořit v rámci tohoto stipendijního programu.',	'secondRating'),
(67,	81,	1,	'Vzhledem k nejasnostem týkajících se případných příjemců stipendia, velice neefektivnímu nakládání s požadovanými finančními prostředky a celkové povaze projektu, který svým rozsahem přesahuje FSS a měl by tak dle mého názoru být případně podporován spíše na celo-univerzitní úrovni, jsem se rozhodl jej nepodpořit.\r\n\r\nŽádost o finanční podporu by dle mého názoru neměla být motivována pouze faktem, že ji lze podat. Fakt, že projekt žádá o proplácení každoročního opakovaného psaní článků o stále stejných oborech a to různými lidmi, místo toho aby články byly v případě potřeby pouze aktualizovány, na mě působí dojmem umělého nafukování rozpočtu a nebo přinejmenším vysoce neefektivního hospodaření. Věřím že je lepší upřednostnit pro tento druh stipendia vhodnější projekty, které jsou navíc většinou střídmější v odměnách pokud s nimi vůbec počítají, přičemž na stipendijní podpoře mnohdy závisí především jejich samotná technická proveditelnost.',	'secondRating'),
(67,	72,	1,	'Nedoporučuji k podpoře, neboť psát znovu články na stejné téma (s drobnými změnami údajů) je hrozně neefektivní a žadatelka mě nedokázala přesvědčit, že to má nějaký reálný smysl. \r\nPrvákoviny, až na drobné výjímky, čtou každým rokem jiní lidé, kteří těžko mohou posoudit, zda je článek starý nebo nový. \r\nI přes snížení požadované částky je tak projekt neuvěřitelně neefektivní, a to ani nemluvím o trvající neprůhlednosti alokace prostředků a neospravedlněným manažerským odměnám za vedení.\r\nPsaní článků do celouniverzitní mutace by rovněž měla platit univerzita, a to nehledě na to, odkud jejich autoři pocházejí.',	'secondRating'),
(66,	72,	0,	'Děkuji za snížení částky, která byla velmi přemrštěná. Projekt však zůstává velmi neprůhledný a spojení s FSS nejasné a spíše volné (v jedenáctihlavé redakci jsou pouze 3 studenti FSS).',	'secondRating'),
(60,	72,	0,	'Velmi kvalitní projekt, který doporučuji k podpoření. Přednášky J.Rupnika jsem se zúčastnil a dost se povedla.',	'secondRating'),
(62,	72,	0,	'Vzhledem k předloženým informacím věřím, že se Vám projekt povede zrealizovat a podporuji ho. Rozpočet je reálný a efektivní.',	'secondRating'),
(61,	72,	0,	'Líbí se mi, že jste pro odměny redaktorům zvolili poukázky na knihu. Nákup diktafonu a hosting mi rovněž příjdou v pořádku a nevidím tak důvod projekt nepodpořit.',	'secondRating'),
(64,	76,	0,	'Děkuji za konstruktivní deliberaci a výrazné snížení částky. S projektem nyní nemám nejmenší problém. ',	'secondRating'),
(65,	76,	0,	'Odměna 2500 Kč na osobu pořád patří mezi ty vyšší, i když si dokážu představit, kolik dřiny vedení časopisu zabere. Stejně by mě ale potěšilo, kdyby se pár stovek dostalo i mezi ostatní redaktory :)',	'secondRating'),
(66,	76,	0,	'Odměna byla zredukována na přiměřenou míru, projekt tudíž nemíním blokovat. Pro příště bych ale preferoval, aby odměny pro své členy žádal projekt jako celek, ne jednotlivec. ',	'secondRating'),
(59,	76,	0,	'Na deliberaci proběhlo velmi dobře představení projektu a zmizel tudíž důvod projekt nepodpořit: naopak, pro mne se ukázal jako jeden z nejoriginálnějších za poslední dobu. Gratuluji oběma slečnám a plně fandím v další práci. ',	'secondRating'),
(62,	76,	0,	'Bez připomínek, dobrý projekt. ',	'secondRating'),
(67,	76,	1,	'I přes podstatné snížení částky jsem se nakonec rozhodl projekt z vícerých důvodů nepodpořit. Nelíbí se mi zejména:\r\n\r\n1. Shromáždění velké částky u jediné osoby, která by je pak měla rozdělovat.\r\n\r\n2. Nejastnost toho, komu peníze skutečně půjdou + plánované peníze pro osoby mimo FSS\r\n\r\n3. Neefektivní využití peněz (odměna za napsání článků, které se de facto nijak neliší od těch loňských)\r\n\r\nNepovažuji za klíčové, aby měl projekt k dispozici peníze na odměny ještě před svým uskutečněním: na tom projekt nestojí ani nepadá. Zažádejte si o odměny znovu na podzim s jasným výsledkem své práce v zádech a s podrobným rozpisem toho, komu peníze skutečně půjdou. Za takových podmínek není důvod projekt nepodpořit.\r\n\r\nRád bych totiž upozornil, že kauzalita odměňování je: Práce => Odměna; nikoliv Odměna => Práce. ',	'secondRating'),
(61,	76,	0,	'Bez připomínek',	'secondRating'),
(63,	76,	0,	'S projektem jsem neměl problém ani v prvním kole',	'secondRating'),
(60,	76,	0,	'Dotáhnout Jacquese Rupnika na FSS bylo ohromné :) ',	'secondRating'),
(59,	72,	0,	'Na deliberaci jste dokázali pěkně představit Váš projekt a jeho záměry, současně i prezentovat výsledky.',	'secondRating'),
(65,	72,	0,	'Mé nejasnosti byly objasněny, nemám problém s podporou Vašeho projektu.',	'secondRating'),
(64,	72,	0,	'Snížení částky postavil projekt, který jsem původně považoval za velmi neefektivní, do mnohem lepší pozice.\r\nMyslím, že byste určitě měli využít zápisu a jít na něj bootcamp osobně prezentovat.',	'secondRating'),
(63,	72,	0,	'Líbí se mi nápad s prezentací bakalářských prací, Váš projekt je nejen z tohoto důvodu určitě vhodný k realizaci.',	'secondRating');
