INSERT INTO `ratingCategories` (`id`, `name`, `description`) VALUES
(1,	'Důvěryhodnost',	'tradice daného projektu, zkušenosti žadatelů, kofinancování ze soukromých zdrojů.'),
(2,	'Náplň',	'odborný přínos pro zúčastněné, kulturní přínos pro zúčastněné, rozvoj občanských dovedností, rozvoj dalších dovedností'),
(3,	'Produkce',	'odborná produkce projektu, kulturní produkce projektu, propagace FSS'),
(4,	'Zpracování',	'detailní odhad nákladů, plán propagace, časový plán realizace, detailní kritéria úspěšnosti projektu, personální zajištění'),
(5,	'Zaměření',	'spojitost projektu s vzdělávací činností fakulty, realizace v rukou studentů FSS, účast studentů FSS.'),
(6,	'Důvěryhodnost',	'Zejména tradice daného projektu, zkušenosti žadatelů, další zdroje financování'),
(7,	'Odborný a kulturní přínos',	''),
(8,	'Rozvoj dovedností',	''),
(9,	'Zpracování',	'Plán propagace a realizace, zhodnocení úspěšnosti projektu'),
(10,	'Rozpočet',	''),
(11,	'Propagace FSS a spojitost projektu se vzdělávací činností fakulty',	''),
(12,	'Realizace studenty FSS, víceoborovost či mezifakultnost',	''),
(13,	'Důvěryhodnost',	'zkušenosti žadatelů s realizací tohoto či obdobných projektů'),
(14,	'Odborný/kulturní přínos',	'příspěvek projektu k odborné způsobilosti a znalostem účastníků i pořadatelů projektu'),
(15,	'Souvislost se vzdělávací činností FSS',	'jak je projekt provázán s výukou na některém z oborů FSS?'),
(16,	'Rozvoj občanských dovedností',	'Vede projekt k podpoře udržitelné budoucnosti občanské společnosti? Pomáhá studentům aktivně se zapojit do života ve společnosti a podílí se na rozvoji demokracie na základě informovaného občanství?'),
(17,	'Rozvoj praktických dovedností',	'učí se studenti účastí na projektu něčemu užitečnému?'),
(18,	'Kritéria úspěšnosti',	'uvedli žadatelé, co od projektu očekávají a jak budou hodnotit jeho výsledky?'),
(19,	'Uskutečnitelnost',	'týká se předloženého plánu realizace, personálního zajištění projektu, očekávané účasti atd.'),
(20,	'Plán realizace odpovídající cílům',	'povede navržený projekt k očekávaným výsledkům?'),
(21,	'Efektivita',	'nakládá projekt s financemi účelně?'),
(22,	'Podrobnost zpracování rozpočtu',	'jsou jednotlivé náklady rozepsány a odpovídají skutečným cenám?'),
(23,	'Propagace FSS',	'jak projekt přispívá k veřejné obeznámenosti s FSS?'),
(24,	'Zaměření na studenty FSS',	'budou se projektu účastnit studenti FSS?');
